INSERT INTO public.cannabis_article VALUES (2, 'Synthetic and plant-derived cannabinoid receptor antagonists show hypophagic properties in fasted and non-fasted mice.', 19378378, '2009-01-01', 'BACKGROUND AND PURPOSE Obesity is a severe health problem in the modernized world and understanding the central nervous mechanisms underlying food-seeking behaviour and reward are at the forefront of medical research. Cannabinoid receptors have proven an efficient target to suppress hunger and weight gain by their pharmacological inactivation. EXPERIMENTAL APPROACH A standard fasted protocol and a novel long-term home-cage observation system with free-feeding animals were used to assess the feeding behaviour of mice treated with the CB1 antagonist AM251. Similarly, the effects of the phytocannabinoid Delta9-tetrahydrocannabivarin (Delta9-THCV), which behaves like a CB1 antagonist, were also determined in free-feeding animals. KEY RESULTS AM251 suppressed food intake and weight gain in fasted and non-fasted animals. The suppression of food intake by AM251 (10 mg.kg-1) endured for a period of 6-8 h when administered acutely, and was continuous when injected for four consecutive days. Pure Delta9-THCV also induced hypophagia and weight reduction at doses as low as 3 mg.kg-1. No rebound was observed on the following day with all drug groups returning to normal activity and feeding regimes. However, a Delta9-THCV-rich cannabis-extract failed to suppress food intake and weight gain, possibly due to residual Delta9-tetrahydrocannabinol (Delta9-THC) in the extract. This Delta9-THC effect was overcome by the co-administration of cannabidiol. CONCLUSIONS AND IMPLICATIONS The data strongly suggest (i) the long-term home-cage observation system is a sensitive and obesity-relevant tool, and (ii) the phytocannabinoid Delta9-THCV is a novel compound with hypophagic properties and a potential treatment for obesity', NULL, 2419);
INSERT INTO public.cannabis_article VALUES (3, 'Inhibitory effect of standardized cannabis sativa extract and its ingredient cannabidiol on rat and human bladder contractility.', 21310467, '2011-01-01', 'OBJECTIVES To evaluate the effect of a Cannabis sativa extract enriched in cannabidiol (CBD) botanic drug substance (BDS) and pure CBD, on bladder contractility in vitro. Cannabis based-medicines, including CBD-enriched extracts, have been shown to reduce urinary urgency, incontinence episodes, frequency, and nocturia in patients with multiple sclerosis. METHODS Strips were cut from male Wistar rats and the human bladder body and placed in organ baths containing Krebs solution. Contractions were induced by electrical field stimulation, acetylcholine, KCl, and ,-methylene adenosine triphosphate. RESULTS CBD BDS significantly reduced the contractions induced by acetylcholine, but not those induced with electrical field stimulation, KCl, or ,-methylene adenosine triphosphate in the isolated rat bladder. The inhibitory effect of CBD BDS was not significantly modified by the cannabinoid or opioid receptor antagonists or by modulators of calcium levels, but it was increased by ruthenium red and capsazepine, 2 transient receptor potential vanilloid type-1 blockers. In humans, CBD BDS and pure CBD significantly reduced acetylcholine-induced contractions, an effect that was not changed by the transient receptor potential vanilloid type-1 blockers. CONCLUSIONS Our data have suggested that CBD BDS reduces cholinergic-mediated contractility and that this effect is modulated by transient receptor potential vanilloid type-1 in rats but not in humans. CBD is the chemical ingredient of CBD BDS responsible for such activity. If confirmed in vivo, such results could provide a pharmacologic basis to explain, at least in part, the efficacy of Cannabis medicines in reducing incontinence episodes in patients with multiple sclerosis.', NULL, 2454);
INSERT INTO public.cannabis_article VALUES (4, 'Pre- and post-conditioning treatment with an ultra-low dose of 9-tetrahydrocannabinol (THC) protects against pentylenetetrazole (PTZ)-induced cognitive damage.', 21315768, '2011-01-01', 'Preconditioning, a phenomenon where a minor noxious stimulus protects from a subsequent more severe insult, and post-conditioning, where the protective intervention is applied following the insult, offer new insight into the neuronal mechanism(s) of neuroprotection and may provide new strategies for the prevention and treatment of brain damage. We have previously reported that a single administration of an extremely low dose of (9)-tetrahydrocannabinol (THC; the psychoactive ingredient of marijuana) to mice induced minor long-lasting cognitive deficits. In the present study we examined the possibility that such a low dose of THC will protect the mice from more severe cognitive deficits induced by the epileptogenic drug pentylenetetrazole (PTZ). THC (0.002 mg/kg, a dose that is 3-4 orders of magnitude lower than the doses that induce the conventional effects of THC) was administered 1-7 days before, or 1-3 days after the injection of PTZ (60 mg/kg). The consequences of this treatment were studied 3-7 weeks later by various behavioral tests that evaluated different aspects of memory and learning. We found that a single administration of THC either before or after PTZ abolished the PTZ-induced long-lasting cognitive deficits. Biochemical studies indicated a concomitant reduction in phosphorylated-ERK (extracellular signal-regulated kinase) in the cerebella of mice 7 weeks following the injection of THC. Our results suggest that a pre- or post-conditioning treatment with extremely low doses of THC, several days before or after brain injury, may provide safe and effective long-term neuroprotection.', NULL, 2422);
INSERT INTO public.cannabis_article VALUES (5, 'Symptom-relieving and neuroprotective effects of the phytocannabinoid -THCV in animal models of Parkinson''s disease.', 21323909, '2011-01-01', 'BACKGROUND AND PURPOSE Previous findings have indicated that a cannabinoid, such as (9)-THCV, which has antioxidant properties and the ability to activate CB(2) receptors but to block CB(1) , might be a promising therapy for alleviating symptoms and delaying neurodegeneration in Parkinson''s disease (PD). EXPERIMENTAL APPROACH The ability of (9)-THCV to reduce motor inhibition and provide neuroprotection was investigated in rats lesioned with 6-hydroxydopamine and in mice lesioned with lipopolysaccharide (LPS). KEY RESULTS Acute administration of (9)-THCV attenuated the motor inhibition caused by 6-hydroxydopamine, presumably through changes in glutamatergic transmission. Moreover, chronic administration of (9)-THCV attenuated the loss of tyrosine hydroxylase-positive neurones caused by 6-hydroxydopamine in the substantia nigra, through an effect related to its antioxidant properties (it was reproduced by cannabidiol -enriched botanical extract). In addition, CB(2) receptor-deficient mice responded to 6-hydroxydopamine in a similar manner to wild-type animals, and CB(2) receptors were poorly up-regulated in the rat substantia nigra in response to 6-hydroxydopamine. By contrast, the substantia nigra of mice that had been injected with LPS exhibited a greater up-regulation of CB(2) receptors. In these animals, (9)-THCV also caused preservation of tyrosine hydroxylase-positive neurones. This effect probably involved CB(2) receptors as it was also elicited by the selective CB(2) receptor agonist, HU-308, and CB(2) receptor-deficient mice were more vulnerable to LPS lesions. CONCLUSIONS AND IMPLICATIONS Given its antioxidant properties and its ability to activate CB(2) but to block CB(1) receptors, (9)-THCV has a promising pharmacological profile for delaying disease progression in PD and also for ameliorating parkinsonian symptoms.', NULL, 2419);
INSERT INTO public.cannabis_article VALUES (6, 'Tetrahydrocannabinolic acid is a potent PPAR agonist with neuroprotective activity.', 28853159, '2017-01-01', 'BACKGROUND AND PURPOSE Phytocannabinoids are produced in Cannabis sativa L. in acidic form and are decarboxylated upon heating, processing and storage. While the biological effects of decarboxylated cannabinoids such as 9 -tetrahydrocannabinol have been extensively investigated, the bioactivity of 9 -tetahydrocannabinol acid (9 -THCA) is largely unknown, despite its occurrence in different Cannabis preparations. Here we have assessed possible neuroprotective actions of 9 -THCA through modulation of PPAR pathways. EXPERIMENTAL APPROACH The effects of six phytocannabinoids on PPAR binding and transcriptional activity were investigated. The effect of 9 -THCA on mitochondrial biogenesis and PPAR coactivator 1- expression was investigated in Neuro-2a (N2a) cells. The neuroprotective effect was analysed in STHdhQ111/Q111 cells expressing a mutated form of the huntingtin protein and in N2a cells infected with an adenovirus carrying human huntingtin containing 94 polyQ repeats (mHtt-q94). The in vivo neuroprotective activity of 9 -THCA was investigated in mice intoxicated with the mitochondrial toxin 3-nitropropionic acid (3-NPA). KEY RESULTS Cannabinoid acids bind and activate PPAR with higher potency than their decarboxylated products. 9 -THCA increased mitochondrial mass in neuroblastoma N2a cells and prevented cytotoxicity induced by serum deprivation in STHdhQ111/Q111 cells and by mutHtt-q94 in N2a cells. 9 -THCA, through a PPAR-dependent pathway, was neuroprotective in mice treated with 3-NPA, improving motor deficits and preventing striatal degeneration. In addition, 9 -THCA attenuated microgliosis, astrogliosis and up-regulation of proinflammatory markers induced by 3-NPA. CONCLUSIONS AND IMPLICATIONS 9 -THCA shows potent neuroprotective activity, which is worth considering for the treatment of Huntington''s disease and possibly other neurodegenerative and neuroinflammatory diseases.', NULL, 2419);
INSERT INTO public.cannabis_article VALUES (7, 'Cannabidiol Does Not Dampen Responses to Emotional Stimuli in Healthy Adults.', 28861510, '2017-01-01', 'Introduction: Cannabidiol (CBD) is a nonpsychoactive constituent of whole plant cannabis that has been reported to reduce anxiety-like behaviors in both pre-clinical and human laboratory studies. Yet, no controlled clinical studies have demonstrated its ability to reduce negative mood or dampen responses to negative emotional stimuli in humans. The objective of this study was to investigate the effects of CBD on responses to negative emotional stimuli, as a model for its potential anxiety-reducing effects. Materials and Methods: The study used a double-blind, placebo (PLB)-controlled, within-subjects design in which 38 healthy, drug-free participants consumed oral CBD (300, 600, and 900 mg) or PLB before completing several behavioral tasks selected to assess reactivity to negative stimuli. Dependent measures included emotional arousal to negative and positive visual stimuli, perceptual sensitivity to emotional facial expressions, attentional bias toward emotional facial expressions, and feelings of social rejection. In addition, subjective drug effects and physiological data were also gathered during each experimental session to assess drug effects. Discussion: CBD did not dampen responses to negative emotional stimuli and did not affect feelings of social rejection. The high dose of CBD (900 mg) marginally reduced attentional bias toward happy and sad facial expressions, and produced a slight increase in late-session heart rate. CBD did not produce detectable subjective effects or alterations in mood or anxiety. Conclusion: These findings indicate that CBD has minimal behavioral and subjective effects in healthy volunteers, even when they are presented with emotional stimuli. Further research into the behavioral and neural mechanisms of CBD and other phytocannabinoids is needed to ascertain the clinical function of this drug.', 'behavior; cannabidiol; emotional stimuli; psychopharmacology', 2475);
INSERT INTO public.cannabis_article VALUES (8, 'Mechanisms of action of cannabidiol in adoptively transferred experimental autoimmune encephalomyelitis.', 28867485, '2017-01-01', 'Cannabidiol (CBD) is one of the most important compounds in Cannabis sativa, lacks psychotropic effects, and possesses a high number of therapeutic properties including the amelioration of experimental autoimmune encephalomyelitis (EAE). The aim of this study was to analyse the relative efficacy of CBD in adoptively transferred EAE (at-EAE), a model that allows better delineation of the effector phase of EAE. Splenocytes and lymph nodes from mice with actively induced EAE were cultured in the presence of MOG35-55 and IL-12 and inoculated intraperitoneally in recipient female C57BL/6J mice. The effects of CBD were evaluated using clinical scores and magnetic resonance imaging (MRI). In the central nervous system, the extent of cell infiltration, axonal damage, demyelination, microglial activation and cannabinoid receptors expression was assessed by immunohistochemistry. Lymph cell viability, apoptosis, oxidative stress and IL-6 production were measured in vitro. Preventive intraperitoneal treatment with CBD ameliorated the clinical signs of at-EAE, and this improvement was accompanied by a reduction of the apparent diffusion coefficient in the subiculum area of the brain. Inflammatory infiltration, axonal damage, and demyelination were reduced, and cannabinoid receptor expression was modulated. Incubation with CBD decreased encephalitogenic cell viability, increasing early apoptosis and reactive oxygen species (ROS) and decreasing IL-6 production. The reduction in viability was not mediated by CB1, CB2 or GPR55 receptors. CBD markedly improved the clinical signs of at-EAE and reduced infiltration, demyelination and axonal damage. The CBD-mediated decrease in the viability of encephalitogenic cells involves ROS generation, apoptosis and a decrease in IL-6 production and may contribute to the therapeutic effect of this compound.', 'Cannabidiol; Cannabinoid; Experimental autoimmune encephalomyelitis', 2461);
INSERT INTO public.cannabis_article VALUES (9, 'The analgesic effect of oral delta-9-tetrahydrocannabinol (THC), morphine, and a THC-morphine combination in healthy subjects under experimental pain conditions.', 14499423, '2003-01-01', 'From folk medicine and anecdotal reports it is known that Cannabis may reduce pain. In animal studies it has been shown that delta-9-tetrahydrocannabinol (THC) has antinociceptive effects or potentiates the antinociceptive effect of morphine. The aim of this study was to measure the analgesic effect of THC, morphine, and a THC-morphine combination (THC-morphine) in humans using experimental pain models. THC (20 mg), morphine (30 mg), THC-morphine (20 mg THC+30 mg morphine), or placebo were given orally and as single doses. Twelve healthy volunteers were included in the randomized, placebo-controlled, double-blinded, crossover study. The experimental pain tests (order randomized) were heat, cold, pressure, single and repeated transcutaneous electrical stimulation. Additionally, reaction time, side-effects (visual analog scales), and vital functions were monitored. For the pharmacokinetic profiling, blood samples were collected. THC did not significantly reduce pain. In the cold and heat tests it even produced hyperalgesia, which was completely neutralized by THC-morphine. A slight additive analgesic effect could be observed for THC-morphine in the electrical stimulation test. No analgesic effect resulted in the pressure and heat test, neither with THC nor THC-morphine. Psychotropic and somatic side-effects (sleepiness, euphoria, anxiety, confusion, nausea, dizziness, etc.) were common, but usually mild.', NULL, 2486);
INSERT INTO public.cannabis_article VALUES (10, 'The analgesic effect of oral delta-9-tetrahydrocannabinol (THC), morphine, and a THC-morphine combination in healthy subjects under experimental pain conditions.', 14499423, '2003-01-01', 'From folk medicine and anecdotal reports it is known that Cannabis may reduce pain. In animal studies it has been shown that delta-9-tetrahydrocannabinol (THC) has antinociceptive effects or potentiates the antinociceptive effect of morphine. The aim of this study was to measure the analgesic effect of THC, morphine, and a THC-morphine combination (THC-morphine) in humans using experimental pain models. THC (20 mg), morphine (30 mg), THC-morphine (20 mg THC+30 mg morphine), or placebo were given orally and as single doses. Twelve healthy volunteers were included in the randomized, placebo-controlled, double-blinded, crossover study. The experimental pain tests (order randomized) were heat, cold, pressure, single and repeated transcutaneous electrical stimulation. Additionally, reaction time, side-effects (visual analog scales), and vital functions were monitored. For the pharmacokinetic profiling, blood samples were collected. THC did not significantly reduce pain. In the cold and heat tests it even produced hyperalgesia, which was completely neutralized by THC-morphine. A slight additive analgesic effect could be observed for THC-morphine in the electrical stimulation test. No analgesic effect resulted in the pressure and heat test, neither with THC nor THC-morphine. Psychotropic and somatic side-effects (sleepiness, euphoria, anxiety, confusion, nausea, dizziness, etc.) were common, but usually mild.', NULL, 2486);
INSERT INTO public.cannabis_article VALUES (11, 'Low dose oral cannabinoid therapy reduces progression of atherosclerosis in mice.', 15815632, '2005-01-01', 'Atherosclerosis is a chronic inflammatory disease, and is the primary cause of heart disease and stroke in Western countries. Derivatives of cannabinoids such as delta-9-tetrahydrocannabinol (THC) modulate immune functions and therefore have potential for the treatment of inflammatory diseases. We investigated the effects of THC in a murine model of established atherosclerosis. Oral administration of THC (1 mg kg(-1) per day) resulted in significant inhibition of disease progression. This effective dose is lower than the dose usually associated with psychotropic effects of THC. Furthermore, we detected the CB2 receptor (the main cannabinoid receptor expressed on immune cells) in both human and mouse atherosclerotic plaques. Lymphoid cells isolated from THC-treated mice showed diminished proliferation capacity and decreased interferon-gamma secretion. Macrophage chemotaxis, which is a crucial step for the development of atherosclerosis, was also inhibited in vitro by THC. All these effects were completely blocked by a specific CB2 receptor antagonist. Our data demonstrate that oral treatment with a low dose of THC inhibits atherosclerosis progression in the apolipoprotein E knockout mouse model, through pleiotropic immunomodulatory effects on lymphoid and myeloid cells. Thus, THC or cannabinoids with activity at the CB2 receptor may be valuable targets for treating atherosclerosis.', NULL, 2496);
INSERT INTO public.cannabis_article VALUES (12, 'Analgesic effect of delta-9-tetrahydrocannabinol.', 1091664, '1975-01-01', 'A preliminary trial of oral delta-9-tetrahydrocannabinol (THC) demonstrated an analgesic effect of the drug in patients experiencing cancer pain. Placebo and 5, 10, 15, and 20 mg THC were administered double blind to ten patients. Pain relief significantly superior to placebo was demonstrated at high dose levels (15 and 20 mg). At these levels, substantial sedation and mental clouding were reported.', NULL, 2508);
INSERT INTO public.cannabis_article VALUES (13, 'Cannabidiol, unlike synthetic cannabinoids, triggers activation of RBL-2H3 mast cells.', 17339608, '2007-01-01', 'Cannabidiol (CBD), a prominent psychoinactive component of cannabis with negligible affinity for known cannabinoid receptors, exerts numerous pharmacological actions, including anti-inflammatory and immunosuppressive effects, the underlying mechanisms of which remain unclear. In the current study, we questioned whether CBD modulates activation of mast cells, key players in inflammation. By using the rat basophilic leukemia mast cell line (RBL-2H3), we demonstrate that CBD (3-10 muM) augments beta-hexosaminidase release, a marker of cell activation, from antigen-stimulated and unstimulated cells via a mechanism, which is not mediated by G(i)/G(o) protein-coupled receptors but rather is associated with a robust rise in intracellular calcium ([Ca(2+)](i)) levels sensitive to clotrimazole and nitrendipine (10-30 muM). This action, although mimicked by Delta(9)-tetrahydrocannabinol (THC), is opposite to that inhibitory, exerted by the synthetic cannabinoids WIN 55,212-2 and CP 55,940. Moreover, the vanilloid capsaicin, a full agonist of transient receptor potential channel VR1, did not affect [Ca(2+)](i)levels in the RBL-2H3 cells, thus excluding the involvement of this receptor in the CBD-mediated effects. Together, these results support existence of yet-to-be identified sites of interaction, i.e., receptors and/or ion channels associated with Ca(2+) influx of natural cannabinoids such as CBD and THC, the identification of which has the potential to provide for novel strategies and agents of therapeutic interest.', NULL, 2524);
INSERT INTO public.cannabis_article VALUES (14, 'Local delivery of cannabinoid-loaded microparticles inhibits tumor growth in a murine xenograft model of glioblastoma multiforme.', 23349970, '2013-01-01', 'Cannabinoids, the active components of marijuana and their derivatives, are currently investigated due to their potential therapeutic application for the management of many different diseases, including cancer. Specifically, (9)-Tetrahydrocannabinol (THC) and Cannabidiol (CBD) - the two major ingredients of marijuana - have been shown to inhibit tumor growth in a number of animal models of cancer, including glioma. Although there are several pharmaceutical preparations that permit the oral administration of THC or its analogue nabilone or the oromucosal delivery of a THC- and CBD-enriched cannabis extract, the systemic administration of cannabinoids has several limitations in part derived from the high lipophilicity exhibited by these compounds. In this work we analyzed CBD- and THC-loaded poly--caprolactone microparticles as an alternative delivery system for long-term cannabinoid administration in a murine xenograft model of glioma. In vitro characterization of THC- and CBD-loaded microparticles showed that this method of microencapsulation facilitates a sustained release of the two cannabinoids for several days. Local administration of THC-, CBD- or a mixture (1:1 w:w) of THC- and CBD-loaded microparticles every 5 days to mice bearing glioma xenografts reduced tumour growth with the same efficacy than a daily local administration of the equivalent amount of those cannabinoids in solution. Moreover, treatment with cannabinoid-loaded microparticles enhanced apoptosis and decreased cell proliferation and angiogenesis in these tumours. Our findings support that THC- and CBD-loaded microparticles could be used as an alternative method of cannabinoid delivery in anticancer therapies.', NULL, 4457);
INSERT INTO public.cannabis_article VALUES (17, 'Delayed treatment with cannabidiol has a cerebroprotective action via a cannabinoid receptor-independent myeloperoxidase-inhibiting mechanism.', 17437545, '2007-01-01', 'We examined the neuroprotective mechanism of cannabidiol, non-psychoactive component of marijuana, on the infarction in a 4 h mouse middle cerebral artery (MCA) occlusion model in comparison with Delta(9)-tetrahydrocannabinol (Delta(9)-THC). Release of glutamate in the cortex was measured at 2 h after MCA occlusion. Myeloperoxidase (MPO) and cerebral blood flow were measured at 1 h after reperfusion. In addition, infarct size and MPO were determined at 24 and 72 h after MCA occlusion. The neuroprotective effect of cannabidiol was not inhibited by either SR141716 or AM630. Both pre- and post-ischemic treatment with cannabidiol resulted in potent and long-lasting neuroprotection, whereas only pre-ischemic treatment with Delta(9)-THC reduced the infarction. Unlike Delta(9)-THC, cannabidiol did not affect the excess release of glutamate in the cortex after occlusion. Cannabidiol suppressed the decrease in cerebral blood flow by the failure of cerebral microcirculation after reperfusion and inhibited MPO activity in neutrophils. Furthermore, the number of MPO-immunopositive cells was reduced in the ipsilateral hemisphere in cannabidiol-treated group. Cannabidiol provides potent and long-lasting neuroprotection through an anti-inflammatory CB(1) receptor-independent mechanism, suggesting that cannabidiol will have a palliative action and open new therapeutic possibilities for treating cerebrovascular disorders.', NULL, 4239);
INSERT INTO public.cannabis_article VALUES (18, 'Protective Effects of Cannabidiol against Seizures and Neuronal Death in a Rat Model of Mesial Temporal Lobe Epilepsy.', 28367124, '2017-01-01', 'The present study reports the behavioral, electrophysiological, and neuropathological effects of cannabidiol (CBD), a major non-psychotropic constituent of Cannabis sativa, in the intrahippocampal pilocarpine-induced status epilepticus (SE) rat model. CBD was administered before pilocarpine-induced SE (group SE+CBDp) or before and after SE (group SE+CBDt), and compared to rats submitted only to SE (SE group), CBD, or vehicle (VH group). Groups were evaluated during SE (behavioral and electrophysiological analysis), as well as at days one and three post-SE (exploratory activity, electrophysiological analysis, neuron density, and neuron degeneration). Compared to SE group, SE+CBD groups (SE+CBDp and SE+CBDt) had increased SE latency, diminished SE severity, increased contralateral afterdischarge latency and decreased relative powers in delta (0.5-4 Hz) and theta (4-10 Hz) bands. Only SE+CBDp had increased vertical exploratory activity 1-day post SE and decreased contralateral relative power in delta 3 days after SE, when compared to SE group. SE+CBD groups also showed decreased neurodegeneration in the hilus and CA3, and higher neuron density in granule cell layer, hilus, CA3, and CA1, when compared to SE group. Our findings demonstrate anticonvulsant and neuroprotective effects of CBD preventive treatment in the intrahippocampal pilocarpine epilepsy model, either as single or multiple administrations, reinforcing the potential role of CBD in the treatment of epileptic disorders.', 'animal model; cannabidiol; epilepsy; intrahippocampal pilocarpine; neuroprotection', 2713);
INSERT INTO public.cannabis_article VALUES (24, 'Controlled clinical trial of cannabidiol in Huntington''s disease.', 1839644, '1991-01-01', 'Based on encouraging preliminary findings, cannabidiol (CBD), a major nonpsychotropic constituent of Cannabis, was evaluated for symptomatic efficacy and safety in 15 neuroleptic-free patients with Huntington''s Disease (HD). The effects of oral CBD (10 mg/kg/day for 6 weeks) and placebo (sesame oil for 6 weeks) were ascertained weekly under a double-blind, randomized cross-over design. A comparison of the effects of CBD and placebo on chorea severity and other therapeutic outcome variables, and on a Cannabis side effect inventory, clinical lab tests and other safety outcome variables, indicated no significant (p greater than 0.05) or clinically important differences. Correspondingly, plasma levels of CBD were assayed by GC/MS, and the weekly levels (mean range of 5.9 to 11.2 ng/ml) did not differ significantly over the 6 weeks of CBD administration. In summary, CBD, at an average daily dose of about 700 mg/day for 6 weeks, was neither symptomatically effective nor toxic, relative to placebo, in neuroleptic-free patients with HD.', NULL, 4144);
INSERT INTO public.cannabis_article VALUES (22, 'A combined preclinical therapy of cannabinoids and temozolomide against glioma.', 21220494, '2011-01-01', 'Glioblastoma multiforme (GBM) is highly resistant to current anticancer treatments, which makes it crucial to find new therapeutic strategies aimed at improving the poor prognosis of patients suffering from this disease. (9)-Tetrahydrocannabinol (THC), the major active ingredient of marijuana, and other cannabinoid receptor agonists inhibit tumor growth in animal models of cancer, including glioma, an effect that relies, at least in part, on the stimulation of autophagy-mediated apoptosis in tumor cells. Here, we show that the combined administration of THC and temozolomide (TMZ; the benchmark agent for the management of GBM) exerts a strong antitumoral action in glioma xenografts, an effect that is also observed in tumors that are resistant to TMZ treatment. Combined administration of THC and TMZ enhanced autophagy, whereas pharmacologic or genetic inhibition of this process prevented TMZ + THC-induced cell death, supporting that activation of autophagy plays a crucial role on the mechanism of action of this drug combination. Administration of submaximal doses of THC and cannabidiol (CBD; another plant-derived cannabinoid that also induces glioma cell death through a mechanism of action different from that of THC) remarkably reduces the growth of glioma xenografts. Moreover, treatment with TMZ and submaximal doses of THC and CBD produced a strong antitumoral action in both TMZ-sensitive and TMZ-resistant tumors. Altogether, our findings support that the combined administration of TMZ and cannabinoids could be therapeutically exploited for the management of GBM.', NULL, 2646);
INSERT INTO public.cannabis_article VALUES (23, 'Toxicity and carcinogenicity of delta 9-tetrahydrocannabinol in Fischer rats and B6C3F1 mice.', 8812248, '1996-01-01', 'delta 9-Tetrahydrocannabinol (delta 9-THC) was studied for potential carcinogenicity in rodents because it is the principal psychoactive ingredient in marihuana and it has potential medicinal uses. delta 9-THC in corn oil was administered by gavage to groups of male and female Fischer rats and B6C3F1 mice at 0, 5, 15, 50, 150, or 500 mg/kg, 5 days a week for 13 weeks and for 13-week plus a 9-week recovery period, and to groups of rats at 0, 12.5, or 50 mg/kg and mice at 0, 125, 250, or 500 mg/kg, 5 times a week for 2 years. In all studies, mean body weights of dosed male and female rats and mice were lower than controls but feed consumptions were similar. Convulsions and hyperactivity were observed in dosed rats and mice; the onset and frequency were dose related. Serum FSH and LH levels in all dosed male rats and corticosterone levels in 25 mg/kg female rats were significantly higher than controls at 15 months in the 2-year studies. delta 9-THC administration for 13 weeks induced testicular atrophy and uterine and ovarian hypoplasia; the lesions persisted in a 9-week recovery period. In the 2-year studies, survival of dosed rats was higher than controls; that of mice was similar to controls. Incidences of testicular interstitial cell, pancreas and pituitary gland adenomas in male rats, mammary gland fibroadenoma and uterus stromal polyp in female rats, and hepatocellular adenoma/carcinoma in male and female mice were reduced in a dose-related manner. Decreased tumor incidences may be at least in part due to reduced body weights of dosed animals. Incidences of thyroid gland follicular cell hyperplasia were increased in all dosed groups of male and female mice, and follicular cell adenomas were significantly increased in the 125 mg/kg group of males, but there was no evidence of a dose-related trend in proliferative lesions of the thyroid. There was no evidence that delta 9-THC was carcinogenic in rats or mice.', NULL, 2791);
INSERT INTO public.cannabis_article VALUES (25, 'Delta 9-tetrahydrocannabinol injection induces cytokine-mediated mortality of mice infected with Legionella pneumophila.', 7504099, '1993-01-01', 'Delta 9-Tetrahydrocannabinol (THC) injection modulates immune cell function, but the significance of this in altering host resistance to infection is not understood. In addition, exposure to THC and other drugs of abuse during infection is associated with an acute mortality syndrome. We examined the effect of THC injection on the survival of mice infected with Legionella pneumophila (Lp). Mice given two injections of THC (8 mg/kg)-one 24 hr before and the second 24 hr after a sublethal Lp infection-experienced acute collapse and death. The drug injection after infection caused death; deaths occurred within 30 min after the injection, and neither one nor two drug injections before infection resulted in death. The THC-induced mortality resembled cytokine-mediated shock in both kinetics and symptoms; therefore, sera from drug-treated animals were measured for the acute-phase cytokines tumor necrosis factor (TNF) and interleukin 6 (IL6). The level of each cytokine was significantly elevated by THC treatment, suggesting a role in the observed mortality. To directly test this role, mice were administered a single injection of either anti-TNF alpha, anti-IL6, or a mixture of anti-IL1 alpha and -IL1 beta antibodies 1 hr before the second THC injection. Results showed that each antibody treatment protected the mice, with anti-IL6 being the most effective. Fluctuations in blood granulocytes levels also supported a role of acute-phase cytokines in THC-induced mortality. These results show that THC injection increases the blood levels of acute-phase cytokines in infected animal and that these elevated levels, at least in part, account for the mortality induced by THC injection.', '', 2500);
INSERT INTO public.cannabis_article VALUES (1, 'Differential transcriptional profiles mediated by exposure to the cannabinoids cannabidiol and 9-tetrahydrocannabinol in BV-2 microglial cells.', 21542829, '2012-01-01', 'BACKGROUND AND PURPOSE Apart from their effects on mood and reward, cannabinoids exert beneficial actions such as neuroprotection and attenuation of inflammation. The immunosuppressive activity of cannabinoids has been well established. However, the underlying mechanisms are largely unknown. We previously showed that the psychoactive cannabinoid (9) -tetrahydrocannabinol (THC) and the non-psychoactive cannabidiol (CBD) differ in their anti-inflammatory signalling pathways. EXPERIMENTAL APPROACH To characterize the transcriptional effects of CBD and THC, we treated BV-2 microglial cells with these compounds and performed comparative microarray analysis using the Illumina MouseRef-8 BeadChip platform. Ingenuity Pathway Analysis was performed to identify functional subsets of genes and networks regulated by CBD and/or THC. KEY RESULTS Overall, CBD altered the expression of many more genes; from the 1298 transcripts found to be differentially regulated by the treatments, 680 gene probe sets were up-regulated by CBD and 58 by THC, and 524 gene products were down-regulated by CBD and only 36 by THC. CBD-specific gene expression profile showed changes associated with oxidative stress and glutathione depletion, normally occurring under nutrient limiting conditions or proteasome inhibition and involving the GCN2/eIF2/p8/ATF4/CHOP-TRIB3 pathway. Furthermore, CBD-stimulated genes were shown to be controlled by nuclear factors known to be involved in the regulation of stress response and inflammation, mainly via the (EpRE/ARE)-Nrf2/ATF4 system and the Nrf2/Hmox1 axis. CONCLUSIONS AND IMPLICATIONS These observations indicated that CBD, but much less than THC, induced a cellular stress response in microglial cells and suggested that this effect could underlie its anti-inflammatory activity. LINKED ARTICLES This article is part of a themed section on Cannabinoids in Biology and Medicine. To view the other articles in this section visit http://dx.doi.org/10.1111/bph.2012.165.issue-8. To view Part I of Cannabinoids in Biology and Medicine visit http://dx.doi.org/10.1111/bph.2011.163.issue-7.', '2419', NULL);
INSERT INTO public.cannabis_article VALUES (15, 'An ultra-low dose of tetrahydrocannabinol provides cardioprotection.', 23537701, '2013-01-01', 'UNLABELLED Tetrahydrocannabinol (THC), the major psychoactive component of marijuana, is a cannabinoid agonist that exerts its effects by activating at least two specific receptors (CB1 and CB2) that belong to the seven transmembrane G-protein coupled receptor (GPCR) family. Both CB1 and CB2 mRNA and proteins are present in the heart. THC treatment was beneficial against hypoxia in neonatal cardiomyocytes in vitro. We also observed a neuroprotective effect of an ultra low dose of THC when applied to mice before brain insults. The present study was aimed to test and characterize the cardioprotective effects of a very low dose (0.002mg/kg) of THC which is 3-4 orders of magnitude lower than the conventional doses, administered before myocardial infarction in mice in vivo. Three regimens of THC administration were tested: single THC application 2h or 48h before the induction of infarct, or 3 weeks continuous treatment before MI. All protocols of THC administration were found to be beneficial. In the case of THC treatment 2h before MI, fractional shortening was elevated (374% vs. 421%, p<0.04), troponin T leakage to the blood was reduced (143ng/ml vs. 104ng/ml, p<0.008), infarct size decreased (294% vs. 234%, p<0.02), and the accumulation of neutrophils to the infarct area declined (3610cells/field vs. 194cells/field, p<0.007) in THC- compared to vehicle-pretreated mice, 24h after MI. ERK1/2 phosphorylation following infarct was also inhibited by pre-treatment with THC (p<0.01). CONCLUSION A single ultra low dose of THC before ischemia is a safe and effective treatment that reduces myocardial ischemic damage.', '2570', NULL);
INSERT INTO public.cannabis_article VALUES (16, 'Cannabigerol is a novel, well-tolerated appetite stimulant in pre-satiated rats.', 27503475, '2016-01-01', 'RATIONALE The appetite-stimulating properties of cannabis are well documented and have been predominantly attributed to the hyperphagic activity of the psychoactive phytocannabinoid, (9)-tetrahydrocannabinol ((9)-THC). However, we have previously shown that a cannabis extract devoid of (9)-THC still stimulates appetite, indicating that other phytocannabinoids also elicit hyperphagia. One possible candidate is the non-psychoactive phytocannabinoid cannabigerol (CBG), which has affinity for several molecular targets with known involvement in the regulation of feeding behaviour. OBJECTIVES The objective of the study was to assess the effects of CBG on food intake and feeding pattern microstructure. METHODS Male Lister hooded rats were administered CBG (30-120 mg/kg, per ora (p.o.)) or placebo and assessed in open field, static beam and grip strength tests to determine a neuromotor tolerability profile for this cannabinoid. Subsequently, CBG (at 30-240 mg/kg, p.o.) or placebo was administered to a further group of pre-satiated rats, and hourly intake and meal pattern data were recorded over 2 h. RESULTS CBG produced no adverse effects on any parameter in the neuromotor tolerability test battery. In the feeding assay, 120-240 mg/kg CBG more than doubled total food intake and increased the number of meals consumed, and at 240 mg/kg reduced latency to feed. However, the sizes or durations of individual meals were not significantly increased. CONCLUSIONS Here, we demonstrate for the first time that CBG elicits hyperphagia, by reducing latency to feed and increasing meal frequency, without producing negative neuromotor side effects. Investigation of the therapeutic potential of CBG for conditions such as cachexia and other disorders of eating and body weight regulation is thus warranted.', 'Appetite; Appetitive; Cachexia; Cannabigerol; Cannabis; Consummatory; Feeding; Hyperphagia; Phytocannabinoid; Tolerability', 4476);
INSERT INTO public.cannabis_article VALUES (26, 'The combination of cannabidiol and 9-tetrahydrocannabinol enhances the anticancer effects of radiation in an orthotopic murine glioma model.', 25398831, '2014-01-01', 'High-grade glioma is one of the most aggressive cancers in adult humans and long-term survival rates are very low as standard treatments for glioma remain largely unsuccessful. Cannabinoids have been shown to specifically inhibit glioma growth as well as neutralize oncogenic processes such as angiogenesis. In an attempt to improve treatment outcome, we have investigated the effect of (9)-tetrahydrocannabinol (THC) and cannabidiol (CBD) both alone and in combination with radiotherapy in a number of glioma cell lines (T98G, U87MG, and GL261). Cannabinoids were used in two forms, pure (P) and as a botanical drug substance (BDS). Results demonstrated a duration- and dose-dependent reduction in cell viability with each cannabinoid and suggested that THC-BDS was more efficacious than THC-P, whereas, conversely, CBD-P was more efficacious than CBD-BDS. Median effect analysis revealed all combinations to be hyperadditive [T98G 48-hour combination index (CI) at FU50, 0.77-1.09]. Similarly, pretreating cells with THC-P and CBD-P together for 4 hours before irradiation increased their radiosensitivity when compared with pretreating with either of the cannabinoids individually. The increase in radiosensitivity was associated with an increase in markers of autophagy and apoptosis. These in vitro results were recapitulated in an orthotopic murine model for glioma, which showed dramatic reductions in tumor volumes when both cannabinoids were used with irradiation (day 21: 5.5  2.2 mm(3) vs. 48.7  24.9 mm(3) in the control group; P < 0.01). Taken together, our data highlight the possibility that these cannabinoids can prime glioma cells to respond better to ionizing radiation, and suggest a potential clinical benefit for glioma patients by using these two treatment modalities.', '2646', NULL);
INSERT INTO public.cannabis_article VALUES (27, '(9) Tetrahydrocannabinol attenuates Staphylococcal enterotoxin B-induced inflammatory lung injury and prevents mortality in mice by modulation of miR-17-92 cluster and induction of T-regulatory cells.', 25425209, '2015-01-01', 'BACKGROUND AND PURPOSE Staphylococcal enterotoxin B (SEB) is a potent activator of V8+T-cells resulting in the clonal expansion of30% of the T-cell pool. Consequently, this leads to the release of inflammatory cytokines, toxic shock, and eventually death. In the current study, we investigated if (9) tetrahydrocannabinol (THC), a cannabinoid known for its anti-inflammatory properties, could prevent SEB-induced mortality and alleviate symptoms of toxic shock. EXPERIMENTAL APPROACH We investigated the efficacy of THC against the dual administration (intranasal and i.p.) of SEB into C3H/HeJ mice based on the measurement of SEB-mediated clinical parameters, including cytokine production, cellular infiltration, vascular leak, and airway resistance. In addition, the molecular mechanism of action was elucidated in vitro by the activation of splenocytes with SEB. KEY RESULTS Exposure to SEB resulted in acute mortality, while THC treatment led to 100% survival of mice. SEB induced the miRNA-17-92 cluster, specifically miRNA-18a, which targeted Pten (phosphatase and tensin homologue), an inhibitor of the PI3K/Akt signalling pathway, thereby suppressing T-regulatory cells. In contrast, THC treatment inhibited the individual miRNAs in the cluster, reversing the effects of SEB. CONCLUSIONS AND IMPLICATIONS We report, for the first time a role for the miRNA 17-92 cluster in SEB-mediated inflammation. Furthermore, our results suggest that THC is a potent anti-inflammatory compound that may serve as a novel therapeutic to suppress SEB-induced pulmonary inflammation by modulating critical miRNA involved in SEB-induced toxicity and death.', '2419', NULL);
INSERT INTO public.cannabis_article VALUES (28, 'Cannabinoid action induces autophagy-mediated cell death through stimulation of ER stress in human glioma cells.', 19425170, '2009-01-01', 'Autophagy can promote cell survival or cell death, but the molecular basis underlying its dual role in cancer remains obscure. Here we demonstrate that delta(9)-tetrahydrocannabinol (THC), the main active component of marijuana, induces human glioma cell death through stimulation of autophagy. Our data indicate that THC induced ceramide accumulation and eukaryotic translation initiation factor 2alpha (eIF2alpha) phosphorylation and thereby activated an ER stress response that promoted autophagy via tribbles homolog 3-dependent (TRB3-dependent) inhibition of the Akt/mammalian target of rapamycin complex 1 (mTORC1) axis. We also showed that autophagy is upstream of apoptosis in cannabinoid-induced human and mouse cancer cell death and that activation of this pathway was necessary for the antitumor action of cannabinoids in vivo. These findings describe a mechanism by which THC can promote the autophagic death of human and mouse cancer cells and provide evidence that cannabinoid administration may be an effective therapeutic strategy for targeting human cancers.', '2871', NULL);
INSERT INTO public.cannabis_article VALUES (29, 'Beneficial effects of a Cannabis sativa extract treatment on diabetes-induced neuropathy and oxidative stress.', 19441010, '2009-01-01', 'Neuropathy is the most common complication of diabetes and it is still considered to be relatively refractory to most of the analgesics. The aim of the present study was to explore the antinociceptive effect of a controlled cannabis extract (eCBD) in attenuating diabetic neuropathic pain. Repeated treatment with cannabis extract significantly relieved mechanical allodynia and restored the physiological thermal pain perception in streptozotocin (STZ)-induced diabetic rats without affecting hyperglycemia. In addition, the results showed that eCBD increased the reduced glutathione (GSH) content in the liver leading to a restoration of the defence mechanism and significantly decreased the liver lipid peroxidation suggesting that eCBD provides protection against oxidative damage in STZ-induced diabetes that also strongly contributes to the development of neuropathy. Finally, the nerve growth factor content in the sciatic nerve of diabetic rats was restored to normal following the repeated treatment with eCBD, suggesting that the extract was able to prevent the nerve damage caused by the reduced support of this neurotrophin. These findings highlighted the beneficial effects of cannabis extract treatment in attenuating diabetic neuropathic pain, possibly through a strong antioxidant activity and a specific action upon nerve growth factor.', '2773', NULL);
INSERT INTO public.cannabis_article VALUES (50, 'Delata-9-tetrahydrocannabinol as an antiemetic in cancer patients receiving high-dose methotrexate. A prospective, randomized evaluation.', 293141, '1979-01-01', 'Fifteen patients with osteogenic sarcoma receiving high-dose methotrexate chemotherapy were studied in a randomized, double-blind, placebo-controlled trial of oral and smoked delta-9-tetrahydrocannabinol (THC) as an antiemetic. Each patient served as his or her own control. Fourteen of 15 patients had a reduction in nausea and vomiting on THC as compared to placebo. Delta-9-tetrahydrocannabinol was significantly more effective than placebo in reducing the number of vomiting and retching episodes, degree of nausea, duration of nausea, and volume of emesis (P less than 0.001). There was a 72% incidence of nausea and vomiting on placebo. When plasma THC concentrations measured less than 5.0 ng/mL, 5.0 to 10.0 ng/mL, and greater than 10.0 ng/mL, the incidences of nausea and vomiting were 44%, 21%, and 6%, respectively. Delta-9-tetrahydrocannabinol appears to have significant antiemetic properties when compared with placebo in patients receiving high-dose methotrexate.', '2696', NULL);
INSERT INTO public.cannabis_article VALUES (30, 'Cannabidiol attenuates delayed-type hypersensitivity reactions via suppressing T-cell and macrophage reactivity.', 21042286, '2010-01-01', 'AIM to investigate the effects cannabidiol (CBD) on delayed-type hypersensitivity (DTH) reactions and antigen-induced T-cell cytokine expression. METHODS DTH was induced by subcutaneous ovalbumin (OVA) challenge to the footpads of mice sensitized with OVA. Inflammatory reactions were measured by footpad swelling and histological analysis. Antigen-induced cytokine expression by OVA-primed splenocytes was measured using ELISA and RT-PCR. RESULTS CBD (1-10 mg/kg) administration, in a dose-dependent fashion, significantly attenuated inflammatory reactions associated with DTH in the footpads of mice sensitized and challenged with OVA. Histological examination revealed that CBD suppressed the infiltration of T cells and macrophages, and the expression of interferon (IFN)- and tumor necrosis factor-, two pro-inflammatory cytokines implicated in DTH in the inflammatory site. In contrast, the expression of interleukin (IL)-10 in the footpads was enhanced by CBD administration. In addition, CBD at concentrations devoid of cytotoxic effects (1-4 micromol/L) attenuated OVA-induced IFN- production by OVA-primed splenocytes, whereas IL-4 was unaffected. CONCLUSION CBD curbs DTH reactions via suppressing the infiltration and functional activity of T cells and macrophages in the inflammatory site, suggesting a therapeutic potential for CBD for the treatment of type IV hypersensitivity.', '2872', NULL);
INSERT INTO public.cannabis_article VALUES (31, 'delta 9-Tetrahydrocannabinol for refractory vomiting induced by cancer chemotherapy.', 6244418, '1980-01-01', 'Fifty-three patients receiving antineoplastic chemotherapy who had experienced severe nausea and vomiting refractory to standard antiemetic agents were treated with delta 9-tetrahydrocannabinol (THC). These patients were given THC 8 to 12 hours before, during, and for 24 hours after chemotherapy. Ten patients (19%) had no further nausea and vomiting; 28 (53%) had at least a 50% reduction of nausea and vomiting compared to previous courses with the same agents. No appreciable reduction of nausea and vomiting was seen in 15 patients (28%). Toxic reactions were generally mild, with only four patients experiencing reactions that necessitated stopping THC therapy. We suggest that, since THC is a useful antimetic agent in patients having refractory chemotherapy-induced vomiting, existing restrictions prohibiting its therapeutic use should promptly be eased.', '4159', NULL);
INSERT INTO public.cannabis_article VALUES (32, 'Tonic analgesic effects of delta 9-tetrahydrocannabinol as measured with the formalin test.', 6244965, '1980-01-01', 'The analgesic effects of delta 9-tetrahydrocannabinol (THC), the psychoactive component of marihuana, were tested using the formalin test. Rats were treated with either THC (5 mg/kg or 10 mg/kg) or a placebo by gavage 4 h before the formalin test for analgesia was initiated. THC produced a highly significant analgesic effect against both phasic pain and tonic pain. THC is discussed as a model for the development of new analgesics or as a suitable analgesic if used with another potentiating drug.', '4160', NULL);
INSERT INTO public.cannabis_article VALUES (33, 'Antiemetic effect of tetrahydrocannabinol. Compared with placebo and prochlorperazine in chemotherapy-associated nausea and emesis.', 6254456, '1980-01-01', 'Fifty-five patients harboring a variety of neoplasms and previously found to have severe nausea or emesis from antitumor drugs were given antiemetic prophylaxis in a double-blind, randomized, crossover fashion. Tetrahydrocannabinol (THC), prochlorperazine, and placebo were compared. Nausea was absent in 40 of 55 patients receiving THC, eight of 55 patients receiving prochlorperazine, and five of 55 in the placebo group. The antiemetic effect of THC appeared to be more efficacious for cyclophosphamide, fluorouracil, and doxorubicin hydrochloride, and less so for mechlorethamine hydrochloride and the nitrosureas. Tetrahydrocannabinol appears to offer significant control of nausea in most patients and exceeding by far that provided by prochlorperazine.', '2894', NULL);
INSERT INTO public.cannabis_article VALUES (34, 'A prospective evaluation of delta-9-tetrahydrocannabinol as an antiemetic in patients receiving adriamycin and cytoxan chemotherapy.', 6261926, '1981-01-01', 'A randomized, double-blind, placebo-controlled trial of oral and smoked delta-9-tetrahydrocannabinol (THC) was performed in eight patients with resected soft tissue sarcomas who received adjuvant Adriamycin and Cytoxan chemotherapy. Each patient served as his own control. Delta-9-tetrahydrocannabinol, in comparison with a placebo, did not significantly reduce the number of vomiting and retching episodes, volume of emesis, degree of nausea, or duration of nausea. In contrast to a previous report where significant antiemetic effects of THC were observed in patients receiving high-dose methotrexate, THC did not effectively reduce emesis induced by Adriamycin and Cytoxan. These findings suggest that the antiemetic properties of THC are effective only against specific chemotherapeutic drugs.', '2896', NULL);
INSERT INTO public.cannabis_article VALUES (48, 'Hippocampal neurotoxicity of Delta9-tetrahydrocannabinol.', 9651215, '1998-01-01', 'Marijuana consumption elicits diverse physiological and psychological effects in humans, including memory loss. Here we report that Delta9-tetrahydrocannabinol (THC), the major psychoactive component of marijuana, is toxic for hippocampal neurons. Treatment of cultured neurons or hippocampal slices with THC caused shrinkage of neuronal cell bodies and nuclei as well as genomic DNA strand breaks, hallmarks of neuronal apoptosis. Neuron death induced by THC was inhibited by nonsteroidal anti-inflammatory drugs, including indomethacin and aspirin, as well as vitamin E and other antioxidants. Furthermore, treatment of neurons with THC stimulated a significant increase in the release of arachidonic acid. We hypothesize that THC neurotoxicity is attributable to activation of the prostanoid synthesis pathway and generation of free radicals by cyclooxygenase. These data suggest that some of the memory deficits caused by cannabinoids may be caused by THC neurotoxicity.', '2440', NULL);
INSERT INTO public.cannabis_article VALUES (35, 'Colon carcinogenesis is inhibited by the TRPM8 antagonist cannabigerol, a Cannabis-derived non-psychotropic cannabinoid.', 25269802, '2014-01-01', 'Cannabigerol (CBG) is a safe non-psychotropic Cannabis-derived cannabinoid (CB), which interacts with specific targets involved in carcinogenesis. Specifically, CBG potently blocks transient receptor potential (TRP) M8 (TRPM8), activates TRPA1, TRPV1 and TRPV2 channels, blocks 5-hydroxytryptamine receptor 1A (5-HT1A) receptors and inhibits the reuptake of endocannabinoids. Here, we investigated whether CBG protects against colon tumourigenesis. Cell growth was evaluated in colorectal cancer (CRC) cells using the 3-(4,5-dimethylthiazole-2-yl)-2,5-diphenyl tetrazolium bromide and 3-amino-7-dimethylamino-2-methylphenazine hydrochloride assays; apoptosis was examined by histology and by assessing caspase 3/7 activity; reactive oxygen species (ROS) production by a fluorescent probe; CB receptors, TRP and CCAAT/enhancer-binding protein homologous protein (CHOP) messenger RNA (mRNA) expression were quantified by reverse transcription-polymerase chain reaction; small hairpin RNA-vector silencing of TRPM8 was performed by electroporation. The in vivo antineoplastic effect of CBG was assessed using mouse models of colon cancer. CRC cells expressed TRPM8, CB1, CB2, 5-HT1A receptors, TRPA1, TRPV1 and TRPV2 mRNA. CBG promoted apoptosis, stimulated ROS production, upregulated CHOP mRNA and reduced cell growth in CRC cells. CBG effect on cell growth was independent from TRPA1, TRPV1 and TRPV2 channels activation, was further increased by a CB2 receptor antagonist, and mimicked by other TRPM8 channel blockers but not by a 5-HT1A antagonist. Furthermore, the effect of CBG on cell growth and on CHOP mRNA expression was reduced in TRPM8 silenced cells. In vivo, CBG inhibited the growth of xenograft tumours as well as chemically induced colon carcinogenesis. CBG hampers colon cancer progression in vivo and selectively inhibits the growth of CRC cells, an effect shared by other TRPM8 antagonists. CBG should be considered translationally in CRC prevention and cure.', '4194', NULL);
INSERT INTO public.cannabis_article VALUES (36, 'Synergistic cytotoxicity of Delta(9)-tetrahydrocannabinol and butylated hydroxyanisole.', 12119125, '2002-01-01', 'We examined the food additive, butylated hydroxyanisole (BHA), for its capacity to modulate the cytotoxic effects of Delta(9)-tetrahydrocannabinol (THC). THC was not cytotoxic when added to cultures of A549 lung tumor cells at concentrations<5 microg/ml, but induced cell necrosis at higher levels with an LC(50)=16-18 microg/ml. BHA alone, at concentrations of 10-200 microM, produced limited cell toxicity but significantly enhanced the necrotic death resulting from concurrent exposure to THC. In the presence of BHA at 200 microM, the LC(50) for THC decreased to 10-12 microg/ml. Similar results were obtained with smoke extracts prepared from marijuana cigarettes, but not with extracts from tobacco or placebo marijuana cigarettes (containing no THC). Two different mechanisms for this synergistic cytotoxicity were investigated. Experiments were repeated in the presence of either diphenyleneiodonium or dicumarol as inhibitors of the redox cycling pathway. Neither of these compounds protected cells from the effects of combined THC and BHA, but rather enhanced necrotic cell death. Measurements of cellular ATP revealed that both THC and BHA reduced ATP levels in A549 cells, consistent with toxic effects on mitochondrial electron transport. The combination was synergistic in this respect, reducing ATP levels to <15% of control. Exposure to marijuana smoke in conjunction with BHA, a common food additive, may promote deleterious health effects in the lung.', '2898', NULL);
INSERT INTO public.cannabis_article VALUES (37, 'Antitumor activity of plant cannabinoids with emphasis on the effect of cannabidiol on human breast carcinoma.', 16728591, '2006-01-01', 'Delta(9)-Tetrahydrocannabinol (THC) exhibits antitumor effects on various cancer cell types, but its use in chemotherapy is limited by its psychotropic activity. We investigated the antitumor activities of other plant cannabinoids, i.e., cannabidiol, cannabigerol, cannabichromene, cannabidiol acid and THC acid, and assessed whether there is any advantage in using Cannabis extracts (enriched in either cannabidiol or THC) over pure cannabinoids. Results obtained in a panel of tumor cell lines clearly indicate that, of the five natural compounds tested, cannabidiol is the most potent inhibitor of cancer cell growth (IC(50) between 6.0 and 10.6 microM), with significantly lower potency in noncancer cells. The cannabidiol-rich extract was equipotent to cannabidiol, whereas cannabigerol and cannabichromene followed in the rank of potency. Both cannabidiol and the cannabidiol-rich extract inhibited the growth of xenograft tumors obtained by s.c. injection into athymic mice of human MDA-MB-231 breast carcinoma or rat v-K-ras-transformed thyroid epithelial cells and reduced lung metastases deriving from intrapaw injection of MDA-MB-231 cells. Judging from several experiments on its possible cellular and molecular mechanisms of action, we propose that cannabidiol lacks a unique mode of action in the cell lines investigated. At least for MDA-MB-231 cells, however, our experiments indicate that cannabidiol effect is due to its capability of inducing apoptosis via: direct or indirect activation of cannabinoid CB(2) and vanilloid transient receptor potential vanilloid type-1 receptors and cannabinoid/vanilloid receptor-independent elevation of intracellular Ca(2+) and reactive oxygen species. Our data support the further testing of cannabidiol and cannabidiol-rich extracts for the potential treatment of cancer.', '2500', NULL);
INSERT INTO public.cannabis_article VALUES (38, 'Effects of cannabinoids on lithium-induced conditioned rejection reactions in a rat model of nausea.', 12528012, '2003-01-01', 'RATIONALE Marijuana has been reported to suppress nausea produced by chemotherapy treatment in human cancer patients. Although there is abundant evidence that cannabinoid agonists attenuate vomiting in emetic species, there has been little experimental evidence of their anti-nausea potential. Considerable evidence suggests that conditioned rejection reactions in rats reflect nausea. The present experiments evaluated the potential of low doses of the cannabinoid agonists, delta-9-tetrahydrocannabinol (THC; 0.5 mg/kg, i.p.), and HU-210 (0.001 mg/kg and 0.01 mg/kg, i.p.), and the CB(1) antagonist SR-141716A in modulating the establishment and the expression of lithium-induced conditioned rejection reactions in rats. OBJECTIVES To evaluate the effect of cannabinoids on conditioned rejection reactions, a rat model of nausea. METHODS In experiments 1 and 2, respectively, rats were injected with cannabinoid agonists, THC (0.5 mg/kg, i.p.) and HU-210 (0.001, 0.005 or 0.01 mg/kg), 30 min prior to exposure to 0.1% saccharin solution by intraoral infusion. Immediately following saccharin exposure, they were injected with 20 ml/kg 0.15 M lithium chloride or saline. On each of two test trials, the rats were injected with the cannabinoid or vehicle 30 min prior to exposure to saccharin. In experiment 3, rats were injected with the CB(1) antagonist, SR-141716A (2.5 mg/kg) or a combination of SR-141716A and HU-210 (0.01 mg/kg) 30 min prior to an infusion of saccharin followed by injection of lithium or saline. They were given a single drug-free test trial. Experiment 4 replicated and extended the findings of experiment 3. RESULTS delta-9-THC and HU-210 interfered with the establishment and the expression of lithium-induced conditioned rejection reactions. The suppressive effect of HU-210 on rejection reactions was reversed by pretreatment with SR-141716A. Administration of SR-141716A prior to conditioning potentiated lithium-induced conditioned rejection reactions. CONCLUSIONS These results indicate that the establishment and the expression of lithium-induced conditioned rejection reactions are suppressed by pretreatment with cannabinoid agents. These effects appear to be mediated by their action on the CB(1) receptor, because they are reversed by pretreatment with SR-141716A. Finally, our results suggest that endogenous cannabinoids play a role in modulation of nausea, because the antagonist potentiated lithium-induced nausea.', '4476', NULL);
INSERT INTO public.cannabis_article VALUES (57, 'Quality of Life in Childhood Epilepsy in pediatric patients enrolled in a prospective, open-label clinical study with cannabidiol.', 28617940, '2017-01-01', 'Recent clinical trials indicate that cannabidiol (CBD) may reduce seizure frequency in pediatric patients with certain forms of treatment-resistant epilepsy. Many of these patients experience significant impairments in quality of life (QOL) in physical, mental, and social dimensions of health. In this study, we measured the caregiver-reported Quality of Life in Childhood Epilepsy (QOLCE) in a subset of patients enrolled in a prospective, open-label clinical study of CBD. Results from caregivers of 48 patients indicated an 8.2  9.9-point improvement in overall patient QOLCE (p < 0.001) following 12 weeks of CBD. Subscores with improvement included energy/fatigue, memory, control/helplessness, other cognitive functions, social interactions, behavior, and global QOL. These differences were not correlated to changes in seizure frequency or adverse events. The results suggest that CBD may have beneficial effects on patient QOL, distinct from its seizure-reducing effects; however, further studies in placebo-controlled, double-blind trials are necessary to confirm this finding.', 'Cannabidiol; Epilepsy; Pediatric; Quality of life; Seizures', 4461);
INSERT INTO public.cannabis_article VALUES (43, 'Delta9-Tetrahydrocannabinol inhibits epithelial growth factor-induced lung cancer cell migration in vitro as well as its growth and metastasis in vivo.', 17621270, '2008-01-01', 'Delta(9)-Tetrahydrocannabinol (THC) is the primary cannabinoid of marijuana and has been shown to either potentiate or inhibit tumor growth, depending on the type of cancer and its pathogenesis. Little is known about the activity of cannabinoids like THC on epidermal growth factor receptor-overexpressing lung cancers, which are often highly aggressive and resistant to chemotherapy. In this study, we characterized the effects of THC on the EGF-induced growth and metastasis of human non-small cell lung cancer using the cell lines A549 and SW-1573 as in vitro models. We found that these cells express the cannabinoid receptors CB(1) and CB(2), known targets for THC action, and that THC inhibited EGF-induced growth, chemotaxis and chemoinvasion. Moreover, signaling studies indicated that THC may act by inhibiting the EGF-induced phosphorylation of ERK1/2, JNK1/2 and AKT. THC also induced the phosphorylation of focal adhesion kinase at tyrosine 397. Additionally, in in vivo studies in severe combined immunodeficient mice, there was significant inhibition of the subcutaneous tumor growth and lung metastasis of A549 cells in THC-treated animals as compared to vehicle-treated controls. Tumor samples from THC-treated animals revealed antiproliferative and antiangiogenic effects of THC. Our study suggests that cannabinoids like THC should be explored as novel therapeutic molecules in controlling the growth and metastasis of certain lung cancers.', '2879', NULL);
INSERT INTO public.cannabis_article VALUES (39, 'Attenuation of early phase inflammation by cannabidiol prevents pain and nerve damage in rat osteoarthritis.', 28885454, '2017-01-01', 'Osteoarthritis (OA) is a multifactorial joint disease, which includes joint degeneration, intermittent inflammation, and peripheral neuropathy. Cannabidiol (CBD) is a noneuphoria producing constituent of cannabis that has the potential to relieve pain. The aim of this study was to determine whether CBD is anti-nociceptive in OA, and whether inhibition of inflammation by CBD could prevent the development of OA pain and joint neuropathy. Osteoarthritis was induced in male Wistar rats (150-175 g) by intra-articular injection of sodium monoiodoacetate (MIA; 3 mg). On day 14 (end-stage OA), joint afferent mechanosensitivity was assessed using in vivo electrophysiology, whereas pain behaviour was measured by von Frey hair algesiometry and dynamic incapacitance. To investigate acute joint inflammation, blood flow and leukocyte trafficking were measured on day 1 after MIA. Joint nerve myelination was calculated by G-ratio analysis. The therapeutic and prophylactic effects of peripheral CBD (100-300 g) were assessed. In end-stage OA, CBD dose-dependently decreased joint afferent firing rate, and increased withdrawal threshold and weight bearing (P < 0.0001; n = 8). Acute, transient joint inflammation was reduced by local CBD treatment (P < 0.0001; n = 6). Prophylactic administration of CBD prevented the development of MIA-induced joint pain at later time points (P < 0.0001; n = 8), and was also found to be neuroprotective (P < 0.05; n = 6-8). The data presented here indicate that local administration of CBD blocked OA pain. Prophylactic CBD treatment prevented the later development of pain and nerve damage in these OA joints. These findings suggest that CBD may be a safe, useful therapeutic for treating OA joint neuropathic pain.', '2486', NULL);
INSERT INTO public.cannabis_article VALUES (40, 'Oral delta-9-tetrahydrocannabinol suppresses cannabis withdrawal symptoms.', 16769180, '2007-01-01', 'BACKGROUND This study assessed whether oral administration of delta-9-tetrahydrocannbinol (THC) effectively suppressed cannabis withdrawal in an outpatient environment. The primary aims were to establish the pharmacological specificity of the withdrawal syndrome and to obtain information relevant to determining the potential use of THC to assist in the treatment of cannabis dependence. METHOD Eight adult, daily cannabis users who were not seeking treatment participated in a 40-day, within-subject ABACAD study. Participants administered daily doses of placebo, 30 mg (10 mg/tid), or 90 mg (30 mg/tid) oral THC during three, 5-day periods of abstinence from cannabis use separated by 7-9 periods of smoking cannabis as usual. RESULTS Comparison of withdrawal symptoms across conditions indicated that (1) the lower dose of THC reduced withdrawal discomfort, and (2) the higher dose produced additional suppression in withdrawal symptoms such that symptom ratings did not differ from the smoking-as-usual conditions. Minimal adverse effects were associated with either active dose of THC. CONCLUSIONS This demonstration of dose-responsivity replicates and extends prior findings of the pharmacological specificity of the cannabis withdrawal syndrome. The efficacy of these doses for suppressing cannabis withdrawal suggests oral THC might be used as an intervention to aid cannabis cessation attempts.', '2438', NULL);
INSERT INTO public.cannabis_article VALUES (41, 'Cannabinoid inhibits HIV-1 Tat-stimulated adhesion of human monocyte-like cells to extracellular matrix proteins.', 24742657, '2014-01-01', 'AIMS The aim of this study was to assess the effect of select cannabinoids on human immunodeficiency virus type 1 (HIV-1) transactivating (Tat) protein-enhanced monocyte-like cell adhesion to proteins of the extracellular matrix (ECM). MAIN METHODS Collagen IV, laminin, or an ECM gel was used to construct extracellular matrix layers. Human U937 monocyte-like cells were exposed to Tat in the presence of (9)-tetrahydrocannabinol (THC), CP55,940, and other select cannabinoids. Cell attachment to ECM proteins was assessed using an adhesion assay. KEY FINDINGS THC and CP55,940 inhibited Tat-enhanced attachment of U937 cells to ECM proteins in a mode that was linked to the cannabinoid receptor type 2 (CB2R). The cannabinoid treatment of Tat-activated U937 cells was associated with altered 1-integrin expression and distribution of polymerized actin, suggesting a modality by which these cannabinoids inhibited adhesion to the ECM. SIGNIFICANCE The blood-brain barrier (BBB) is a complex structure that is composed of cellular elements and an extracellular matrix (ECM). HIV-1 Tat promotes transmigration of monocytes across this barrier, a process that includes interaction with ECM proteins. The results indicate that cannabinoids that activate the CB2R inhibit the ECM adhesion process. Thus, this receptor has potential to serve as a therapeutic agent for ablating neuroinflammation associated with HIV-elicited influx of monocytes across the BBB.', '2-Arachidonoylglycerol (PubChem CID: 5282280); Arachidonyl-2-chloroethylamide (PubChem CID: 5311006); CP55,940 (PubChem CID: 104895); Cannabinoid; Cell adhesion; Extracellular matrix; HIV; Monocyte-like cells; SR141716A (PubChem CID: 104850); SR144528 (PubChem CID: 3081355); Tat; U937 cells; abnormal cannabidiol (PubChem CID: 3060519); (9)-tetrahydrocannabinol (PubChem CID: 16078)', 2394);
INSERT INTO public.cannabis_article VALUES (42, 'The psychoactive compound of Cannabis sativa, (9)-tetrahydrocannabinol (THC) inhibits the human trophoblast cell turnover.', 26070387, '2015-01-01', 'The noxious effects of cannabis consumption for fertility and pregnancy outcome are recognized for years. Its consumption during gestation is associated with alterations in foetal growth, low birth weight and preterm labor. The main psychoactive molecule of cannabis, (9)-tetrahydrocannabinol (THC) impairs the production of reproductive hormones and is also able to cross the placenta barrier. However, its effect on the main placental cells, the trophoblasts, are unknown. Actually, the role of THC in cell survival/death of primary human cytotrophoblasts (CTs) and syncytiotrophoblasts (STs) and in the syncytialization process remains to be explored. Here, we show that THC has a dual effect, enhancing MTT metabolism at low concentrations, whereas higher doses decreased cell viability, on both trophoblast phenotypes, though the effects on STs were more evident. THC also diminished the generation of oxidative and nitrative stress and the oxidized form of glutathione, whereas the reduced form of this tripeptide was increased, suggesting that THC prevents ST cell death due to an antioxidant effect. Moreover, this compound enhanced the mitochondrial function of STs, as observed by the increased MTT metabolism and intracellular ATP levels. These effects were independent of cannabinoid receptors activation. Besides, THC impaired CT differentiation into STs, since it decreased the expression of biochemical and morphological biomarkers of syncytialization, through a cannabinoid receptor-dependent mechanism. Together, these results suggest that THC interferes with trophoblast turnover, preventing trophoblast cell death and differentiation, and contribute to disclose the cellular mechanisms that lead to pregnancy complications in women that consume cannabis-derived drugs during gestation.', 'Cannabinoid signalling; Cannabis sativa; Oxidative stress; Placenta; Syncytialization; Tetrahydrocannabinol', 4405);
INSERT INTO public.cannabis_article VALUES (44, 'The effect of cannabinoids on the stretch reflex in multiple sclerosis spasticity.', 27003093, '2016-01-01', 'The aim of this observational study was to assess the efficacy of a tetrahydrocannabinol-cannabidiol (THC : CBD) oromucosal spray on spasticity using the stretch reflex in patients with multiple sclerosis (MS). Numeric rating scale (NRS) for spasticity, modified Ashworth scale (MAS), and the stretch reflex were assessed before and during treatment in 57 MS patients with spasticity eligible for THC : CBD treatment. A significant reduction in stretch reflex amplitude as well as significant reductions of NRS and MAS scores were observed. There was a low concordance between the three measures (stretch reflex, NRS, and MAS), likely related to the different aspects of muscle hypertonia assessed. Stretch reflex responders were taking a significantly higher number of puffs, whereas no differences were found in the responders by the other scales, suggesting that a higher dosage would add benefit if tolerated. The present study confirms the efficacy of cannabinoids in reducing spasticity in patients with MS, suggesting a higher sensitivity and specificity of the stretch reflex compared with other measures. As an objective and quantitative measure of spasticity, the stretch reflex is particularly useful to assess the effects of cannabinoids on spinal excitability and may play a role in future pharmacological studies.', '3073', NULL);
INSERT INTO public.cannabis_article VALUES (45, 'Prohedonic Effect of Cannabidiol in a Rat Model of Depression.', 27010632, '2016-01-01', 'BACKGROUND Accumulating evidence suggests that cannabidiol (CBD) may be an effective and safe anxiolytic agent and potentially also an antidepressant. AIM The objective of this study was to further examine these properties of CBD using the ''depressive-like'' Wistar-Kyoto (WKY) rat, focusing on the drug''s effect on anhedonia-like behaviors. METHODS Forty-eight WKY and 48 control Wistar adult male rats were pretreated orally with CBD (15, 30 and 45 mg/kg) or vehicle. The saccharin preference test (SPT), the elevated plus maze (EPM) test and the novel object exploration (NOE) test were used. RESULTS CBD showed a prohedonic effect on the WKY rats at 30 mg/kg in the SPT. In the NOE, CBD increased exploration of the novel object and locomotion at 45 mg/kg and increased locomotion at 15 mg/kg, indicating an improvement in the characteristically low motivation of WKY rats to explore. There was no similar effect at any dose in the EPM or in open-field behavior in the habituation to the NOE. CONCLUSIONS These findings extend the limited knowledge on the antidepressant effect of CBD, now shown for the first time in a genetic animal model of depression. These results suggest that CBD may be beneficial for the treatment of clinical depression and other states with prominent anhedonia.', '4103', NULL);
INSERT INTO public.cannabis_article VALUES (46, 'Cannabidivarin (CBDV) suppresses pentylenetetrazole (PTZ)-induced increases in epilepsy-related gene expression.', 24282673, '2013-01-01', 'To date, anticonvulsant effects of the plant cannabinoid, cannabidivarin (CBDV), have been reported in several animal models of seizure. However, these behaviourally observed anticonvulsant effects have not been confirmed at the molecular level. To examine changes to epilepsy-related gene expression following chemical convulsant treatment and their subsequent control by phytocannabinoid administration, we behaviourally evaluated effects of CBDV (400 mg/kg, p.o.) on acute, pentylenetetrazole (PTZ: 95 mg/kg, i.p.)-induced seizures, quantified expression levels of several epilepsy-related genes (Fos, Casp 3, Ccl3, Ccl4, Npy, Arc, Penk, Camk2a, Bdnf and Egr1) by qPCR using hippocampal, neocortical and prefrontal cortical tissue samples before examining correlations between expression changes and seizure severity. PTZ treatment alone produced generalised seizures (median: 5.00) and significantly increased expression of Fos, Egr1, Arc, Ccl4 and Bdnf. Consistent with previous findings, CBDV significantly decreased PTZ-induced seizure severity (median: 3.25) and increased latency to the first sign of seizure. Furthermore, there were correlations between reductions of seizure severity and mRNA expression of Fos, Egr1, Arc, Ccl4 and Bdnf in the majority of brain regions in the CBDV+PTZ treated group. When CBDV treated animals were grouped into CBDV responders (criterion: seizure severity 3.25) and non-responders (criterion: seizure severity >3.25), PTZ-induced increases of Fos, Egr1, Arc, Ccl4 and Bdnf expression were suppressed in CBDV responders. These results provide the first molecular confirmation of behaviourally observed effects of the non-psychoactive, anticonvulsant cannabinoid, CBDV, upon chemically-induced seizures and serve to underscore its suitability for clinical development.', 'Cannabidivarin; Cannabinoid; Epilepsy; Pentylenetetrazole; Seizure; qPCR', 4499);
INSERT INTO public.cannabis_article VALUES (47, 'On disruption of fear memory by reconsolidation blockade: evidence from cannabidiol treatment.', 22549120, '2012-01-01', 'The search for reconsolidation blockers may uncover clinically relevant drugs for disrupting memories of significant stressful life experiences, such as those underlying the posttraumatic stress disorder. Considering the safety of systemically administered cannabidiol (CBD), the major non-psychotomimetic component of Cannabis sativa, to animals and humans, the present study sought to investigate whether and how this phytocannabinoid (3-30 mg/kg intraperitoneally; i.p.) could mitigate an established memory, by blockade of its reconsolidation, evaluated in a contextual fear-conditioning paradigm in rats. We report that CBD is able to disrupt 1- and 7-days-old memories when administered immediately, but not 6 h, after their retrieval for 3 min, with the dose of 10 mg/kg being the most effective. This effect persists in either case for at least 1 week, but is prevented when memory reactivation was omitted, or when the cannabinoid type-1 receptors were antagonized selectively with AM251 (1.0 mg/kg). Pretreatment with the serotonin type-1A receptor antagonist WAY100635, however, failed to block CBD effects. These results highlight that recent and older fear memories are equally vulnerable to disruption induced by CBD through reconsolidation blockade, with a consequent long-lasting relief in contextual fear-induced freezing. Importantly, this CBD effect is dependent on memory reactivation, restricted to time window of <6 h, and is possibly dependent on cannabinoid type-1 receptor-mediated signaling mechanisms. We also observed that the fear memories disrupted by CBD treatment do not show reinstatement or spontaneous recovery over 22 days. These findings support the view that reconsolidation blockade, rather than facilitated extinction, accounts for the aforementioned CBD results in our experimental conditions.', '2450', NULL);
INSERT INTO public.cannabis_article VALUES (49, 'Cannabidiol and (-)Delta9-tetrahydrocannabinol are neuroprotective antioxidants.', 9653176, '1998-01-01', 'The neuroprotective actions of cannabidiol and other cannabinoids were examined in rat cortical neuron cultures exposed to toxic levels of the excitatory neurotransmitter glutamate. Glutamate toxicity was reduced by both cannabidiol, a nonpsychoactive constituent of marijuana, and the psychotropic cannabinoid (-)Delta9-tetrahydrocannabinol (THC). Cannabinoids protected equally well against neurotoxicity mediated by N-methyl-D-aspartate receptors, 2-amino-3-(4-butyl-3-hydroxyisoxazol-5-yl)propionic acid receptors, or kainate receptors. N-methyl-D-aspartate receptor-induced toxicity has been shown to be calcium dependent; this study demonstrates that 2-amino-3-(4-butyl-3-hydroxyisoxazol-5-yl)propionic acid/kainate receptor-type neurotoxicity is also calcium-dependent, partly mediated by voltage sensitive calcium channels. The neuroprotection observed with cannabidiol and THC was unaffected by cannabinoid receptor antagonist, indicating it to be cannabinoid receptor independent. Previous studies have shown that glutamate toxicity may be prevented by antioxidants. Cannabidiol, THC and several synthetic cannabinoids all were demonstrated to be antioxidants by cyclic voltametry. Cannabidiol and THC also were shown to prevent hydroperoxide-induced oxidative damage as well as or better than other antioxidants in a chemical (Fenton reaction) system and neuronal cultures. Cannabidiol was more protective against glutamate neurotoxicity than either ascorbate or alpha-tocopherol, indicating it to be a potent antioxidant. These data also suggest that the naturally occurring, nonpsychotropic cannabinoid, cannabidiol, may be a potentially useful therapeutic agent for the treatment of oxidative neurological disorders such as cerebral ischemia.', '2597', NULL);
INSERT INTO public.cannabis_article VALUES (51, 'Cannabidiol attenuates cardiac dysfunction, oxidative stress, fibrosis, and inflammatory and cell death signaling pathways in diabetic cardiomyopathy.', 21144973, '2010-01-01', 'OBJECTIVES In this study, we have investigated the effects of cannabidiol (CBD) on myocardial dysfunction, inflammation, oxidative/nitrative stress, cell death, and interrelated signaling pathways, using a mouse model of type I diabetic cardiomyopathy and primary human cardiomyocytes exposed to high glucose. BACKGROUND Cannabidiol, the most abundant nonpsychoactive constituent of Cannabis sativa (marijuana) plant, exerts anti-inflammatory effects in various disease models and alleviates pain and spasticity associated with multiple sclerosis in humans. METHODS Left ventricular function was measured by the pressure-volume system. Oxidative stress, cell death, and fibrosis markers were evaluated by molecular biology/biochemical techniques, electron spin resonance spectroscopy, and flow cytometry. RESULTS Diabetic cardiomyopathy was characterized by declined diastolic and systolic myocardial performance associated with increased oxidative-nitrative stress, nuclear factor-B and mitogen-activated protein kinase (c-Jun N-terminal kinase, p-38, p38) activation, enhanced expression of adhesion molecules (intercellular adhesion molecule-1, vascular cell adhesion molecule-1), tumor necrosis factor-, markers of fibrosis (transforming growth factor-, connective tissue growth factor, fibronectin, collagen-1, matrix metalloproteinase-2 and -9), enhanced cell death (caspase 3/7 and poly[adenosine diphosphate-ribose] polymerase activity, chromatin fragmentation, and terminal deoxynucleotidyl transferase dUTP nick end labeling), and diminished Akt phosphorylation. Remarkably, CBD attenuated myocardial dysfunction, cardiac fibrosis, oxidative/nitrative stress, inflammation, cell death, and interrelated signaling pathways. Furthermore, CBD also attenuated the high glucose-induced increased reactive oxygen species generation, nuclear factor-B activation, and cell death in primary human cardiomyocytes. CONCLUSIONS Collectively, these results coupled with the excellent safety and tolerability profile of CBD in humans, strongly suggest that it may have great therapeutic potential in the treatment of diabetic complications, and perhaps other cardiovascular disorders, by attenuating oxidative/nitrative stress, inflammation, cell death and fibrosis.', '2666', NULL);
INSERT INTO public.cannabis_article VALUES (52, 'Cannabidiol injected into the bed nucleus of the stria terminalis reduces the expression of contextual fear conditioning via 5-HT1A receptors.', 21148020, '2012-01-01', 'Systemic administration of cannabidiol (CBD) attenuates cardiovascular and behavioral changes induced by re-exposure to a context that had been previously paired with footshocks. Previous results from our group using cFos immunohistochemistry suggested that the bed nucleus of the stria terminalis (BNST) is involved in this effect. The mechanisms of CBD effects are still poorly understood, but could involve 5-HT(1A) receptor activation. Thus, the present work investigated if CBD administration into the BNST would attenuate the expression of contextual fear conditioning and if this effect would involve the activation of 5-HT(1A) receptors. Male Wistar rats with cannulae bilaterally implanted into the BNST were submitted to a 10 min conditioning session (six footshocks, 1.5 mA/3 s). Twenty-four hours later freezing and cardiovascular responses (mean arterial pressure and heart rate) to the conditioning box were measured for 10 min. CBD (15, 30 or 60 nmol) or vehicle was administered 10 min before the re-exposure to the aversive context. The second experiment was similar to the first one except that animals received microinjections of the 5-HT(1A) receptor antagonist WAY100635 (0.37 nmol) 5 min before CBD (30 nmol) treatment. The results showed that CBD (30 and 60 nmol) treatment significantly reduced the freezing and attenuated the cardiovascular responses induced by re-exposure to the aversive context. Moreover, WAY100635 by itself did not change the cardiovascular and behavioral response to context, but blocked the CBD effects. These results suggest that CBD can act in the BNST to attenuate aversive conditioning responses and this effect seems to involve 5-HT(1A) receptor-mediated neurotransmission.', '2657', NULL);
INSERT INTO public.cannabis_article VALUES (58, '9-Tetrahydrocannabinol Suppresses Secretion of IFN by Plasmacytoid Dendritic Cells From Healthy and HIV-Infected Individuals.', 28692581, '2017-01-01', 'Plasmacytoid dendritic cells (pDCs) play a crucial role in host antiviral immune response through secretion of type I interferon. Interferon alpha (IFN), a type I IFN, is critical for mounting the initial response to viral pathogens. A consequence of Human Immunodeficiency Virus-1 (HIV) infection is a decrease in both pDC number and function, but prolonged pDC activity has been linked with progression from HIV infection to the development of AIDS. Patients with HIV in the United States routinely use cannabinoid-based therapies to combat the side effects of HIV infection and antiretroviral therapy. However, cannabinoids, including -tetrahydrocannabinol (THC), are well-characterized immunosuppressants. Here, we report that THC suppressed secretion of IFN by pDC from both healthy and HIV+ donors through a mechanism involving impaired phosphorylation of interferon regulatory factor 7. These results suggest that THC can suppress pDC function during the early host antiviral response by dampening pDC activation.', '2583', NULL);
INSERT INTO public.cannabis_article VALUES (53, 'Gene expression changes in human small airway epithelial cells exposed to Delta9-tetrahydrocannabinol.', 16039398, '2005-01-01', 'Marijuana smoking is associated with inflammation, cellular atypia, and molecular dysregulation of the tracheobronchial epithelium. While marijuana smoke shares many components in common with tobacco, it also contains a high concentration of Delta9-tetrahydrocannabinol (THC). The potential contribution of THC to airway injury was assessed by exposing primary cultures of human small airway epithelial (SAE) cells to THC (0.1-10.0 microg/ml) for either 1 day or 7 days. THC induced a time- and concentration-dependent decrease in cell viability, ATP level, and mitochondrial membrane potential. Using a targeted gene expression array, we observed acute changes (24 h) in the expression of mRNA for caspase-8, catalase, Bax, early growth response-1, cytochrome P4501A1 (CYP1A1), metallothionein 1A, PLAB, and heat shock factor 1 (HSF1). After 7 days of exposure, decrease in expression of mRNA for heat shock proteins (HSPs) and the pro-apoptotic protein Bax was observed, while expression of GADD45A, IL-1A, CYP1A1, and PTGS-2 increased significantly. These findings suggest a contribution of THC to DNA damage, inflammation, and alterations in apoptosis. Treatment with selected prototypical toxicants, 2,3,7,8-tetrachlorodibenznzo-p-dioxin (TCDD) and carbonyl cyanide-p-(trifluoramethoxy)-phenyl hydrazone (FCCP), produced partially overlapping gene expression profiles suggesting some similarity in mechanism of action with THC. THC, delivered as a component of marijuana smoke, may induce a profile of gene expression that contributes to the pulmonary pathology associated with marijuana use.', '2898', NULL);
INSERT INTO public.cannabis_article VALUES (54, 'Cannabidiol limits Tcell-mediated chronic autoimmune myocarditis: implications to autoimmune disorders and organ transplantation.', 26772776, '2016-01-01', 'RATIONALE Myocarditis is a major cause of heart failure and sudden cardiac death in young adults and adolescents. Many cases of myocarditis are associated with autoimmune processes in which cardiac myosin is a major autoantigen. Conventional immunosuppressive therapies often provide unsatisfactory results and are associated with adverse toxicities during the treatment of autoimmune myocarditis. Cannabidiol (CBD) is a non-psychoactive constituent of Marijuana which exerts antiinflammatory effects independent from classical cannabinoid receptors. Recently 80 clinical trials have been reported investigating the effects of CBD in various diseases from inflammatory bowel disease to graft-versus-host disease. CBD-based formulations are used for the management of multiple sclerosis in numerous countries, and CBD also received FDA approval for the treatment of refractory childhood epilepsy and glioblastoma multiforme. OBJECTIVES Herein, using a well-established mouse model of experimental autoimmune myocarditis (EAM) induced by immunization with cardiac myosin emmulsified in adjuvant resulting in T cell-mediated inflammation, cardiomyocyte cell death, fibrosis and myocardial dysfunction, we studied the potential beneficial effects of CBD. RESULTS EAM was characterized by marked myocardial T cell-infiltration, profound inflammatory response, fibrosis (measured by qRT-PCR, histology and immunohistochemistry analyses) accompanied by marked attenuation of both systolic and diastolic cardiac functions measured with pressure-volume conductance catheter technique. Chronic treatment with CBD largely attenuated the CD3+ and CD4+ mediated inflammatory response and injury, myocardial fibrosis and cardiac dysfunction in mice. CONCLUSION CBD may represent a promising novel treatment for management of autoimmune myocarditis and possibly other autoimmune disorders, and organ transplantation.', '3030', NULL);
INSERT INTO public.cannabis_article VALUES (55, 'Dose-related effects of delta-9-THC on emotional responses to acute psychosocial stress.', 28599212, '2017-01-01', 'OBJECTIVES Cannabis smokers often report that they use the drug to relax or to relieve emotional stress. However, few clinical studies have shown evidence of the stress-relieving effects of cannabis or cannabinoid agonists. In this study, we sought to assess the influence of delta-9-tetrahydrocannabinol (THC), a main active ingredient of cannabis, upon emotional responses to an acute psychosocial stressor among healthy young adults. METHODS Healthy volunteers (N=42) participated in two experimental sessions, one with psychosocial stress (Trier Social Stress Test, TSST) and another with a non-stressful task, after receiving 0 (N=13), 7.5mg (N=14) or 12.5mg (N=15) oral THC. Capsules were administered under randomized, double blind conditions, 2.5h before the tasks began. We measured subjective mood and drug effects, vital signs and salivary cortisol before and at repeated times after the capsule and tasks. Subjects also appraised the tasks, before and after completion. RESULTS In comparison to placebo, 7.5mg THC significantly reduced self-reported subjective distress after the TSST and attenuated post-task appraisals of the TSST as threatening and challenging. By contrast, 12.5mg THC increased negative mood overall i.e., both before and throughout the tasks, and pre-task ratings of the TSST as threatening and challenging. It also impaired TSST performance and attenuated blood pressure reactivity to the stressor. CONCLUSIONS Our findings suggest that a low dose of THC produces subjective stress-relieving effects in line with those commonly reported among cannabis users, but that higher doses may non-specifically increase negative mood.', 'Acute stress; Anxiety; Stress-coping; Subjective effects; THC; TSST', 2438);
INSERT INTO public.cannabis_article VALUES (56, 'A single dose of cannabidiol reduces blood pressure in healthy volunteers in a randomized crossover study.', 28614793, '2017-01-01', 'BACKGROUND Cannabidiol (CBD) is a nonpsychoactive phytocannabinoid used in multiple sclerosis and intractable epilepsies. Preclinical studies show CBD has numerous cardiovascular benefits, including a reduced blood pressure (BP) response to stress. The aim of this study was to investigate if CBD reduces BP in humans. METHODS Nine healthy male volunteers were given 600 mg of CBD or placebo in a randomized, placebo-controlled, double-blind, crossover study. Cardiovascular parameters were monitored using a finometer and laser Doppler. RESULTS CBD reduced resting systolic BP (-6 mmHg; P < 0.05) and stroke volume (-8 ml; P < 0.05), with increased heart rate (HR) and maintained cardiac output. Subjects who had taken CBD had lower BP (-5 mmHg; P < 0.05, especially before and after stress), increased HR (+10 bpm; P < 0.01), decreased stroke volume (-13 ml; P < 0.01), and a blunted forearm skin blood flow response to isometric exercise. In response to cold stress, subjects who had taken CBD had blunted BP (-6 mmHg; P < 0.01) and increased HR (+7 bpm; P < 0.05), with lower total peripheral resistance. CONCLUSIONS This data shows that acute administration of CBD reduces resting BP and the BP increase to stress in humans, associated with increased HR. These hemodynamic changes should be considered for people taking CBD. Further research is required to establish whether CBD has a role in the treatment of cardiovascular disorders.', '2588', NULL);
INSERT INTO public.cannabis_article VALUES (63, 'A pilot study of orally administered (1)-trans-tetrahydrocannabinol in the management of patients undergoing radiotherapy for carcinoma of the bronchus.', 22454883, '1974-01-01', '1 (1)-trans-tetrahydrocannabinol ((1)-THC; 10 mg) or a placebo was given orally on 7 days to two groups of six patients on a cross-over pattern with 7 days rest between. 2 The patients were hospitalized, suffering from inoperable bronchogenic carcinoma, subjected to radiation therapy, and anxious. 3 Self-rating mood scales were filled in before, and 2 and 6 h after ingestion on the first and seventh day of medication. 4 Records of sleep, pain, general well-being, temperature, cardiovascular and gastrointestinal parameters were kept. 5 (1)-THC caused drowsiness and improved night sleep, reduced pain, increased fatigue and confusion and reduced elation and vigour; it caused slight tachycardia and hypotension as also did placebo. 6 The effects of (1)-THC were stronger after 2 h than 6 h and no tolerance had developed at 7 days. 7 The management of stressful patients was considered to have been improved by the drug.', '2673', NULL);
INSERT INTO public.cannabis_article VALUES (59, 'Neuroprotective and intraocular pressure-lowering effects of (-)Delta9-tetrahydrocannabinol in a rat model of glaucoma.', 17284931, '2007-01-01', 'In glaucoma, retinal ganglion cell (RGC) death is induced by many risk factors, including ocular hypertension. It has been proposed that glutamate-mediated oxidative stress may also contribute to this RGC death. Cannabinoids are known to possess therapeutic properties including ocular hypotension and antioxidation. In this study, we test the hypothesis that (-)Delta(9)-tetrahydrocannabinol (THC) lowers intraocular pressure (IOP) and prevents RGC death in a rat model of glaucoma. Arat model of experimental glaucoma with chronic, moderately elevated IOP was produced unilaterally by cauterization of episcleral vessels. Rats received weekly injections of THC at a level of 5 mg/kg or vehicle for 20 weeks. IOP of both eyes was measured weekly on anesthetized animals immediately before THC treatment. RGCs were labeled in a retrograde fashion and counted in whole-mounted retinas. IOP was elevated in all operated eyes 1 day after the operation and remained elevated in the vehicle-treated rats throughout 20 weeks. In THC-treated rats, IOP elevation in operated eyes was diminished 2 weeks after operation and remained reduced. IOP in the contralateral control eyes was not affected by THC. In the operated eyes of vehicle-treated animals, there was a loss of approximately 50 and 40% of the RGCs in the peripheral and central retina, respectively. The RGC loss in the operated eyes of the THC-treated animals was reduced to 10-20%. These results demonstrate that THC is a neuroprotectant that preserves RGCs in an experimental model of glaucoma, possibly through a reduction in IOP.', '3151', NULL);
INSERT INTO public.cannabis_article VALUES (60, 'Effectiveness and Tolerability of THC/CBD Oromucosal Spray for Multiple Sclerosis Spasticity in Italy: First Data from a Large Observational Study.', 26571097, '2015-01-01', 'BACKGROUND The prospective, non-interventional Mobility Improvement (MOVE) 2 study was designed to provide real life data on clinical outcomes of patients with treatment-resistant multiple sclerosis (MS) spasticity receiving routine treatment with tetrahydrocannabinol (THC):cannabidiol (CBD) oromucosal spray (Sativex), subsequent to its approval in European countries. METHODS This interim analysis reports on MOVE 2 patients from Italy. RESULTS Interim data from 322 patients (58.3% female; mean age 51.1  10.2 years) were analyzed. From baseline to month 3 of treatment (Visit 3), the mean 0-10 Numerical Rating Scale (NRS) score decreased by -19.1% (-1.6 points, p < 0.0001) and the mean modified Ashworth score decreased from 2.6 to 2.3 points (p < 0.0001). At Visit 3, 24.6% of 203 patients with available data were clinically relevant responders (30% improvement from baseline NRS score; p < 0.001 vs. baseline). The mean reported dose of THC:CBD oromucosal spray was 6.1  2.5 sprays/day at Visit 1 (1 month) and 5.1  2.6 sprays/day at Visit 3 (range 1-12 sprays/day at both timepoints). Forty-one (13.1%) patients reported at least one adverse event (AE), which included 3 serious AEs (1 unrelated). AEs with an incidence 1% were dizziness (5.6%), confusion (2.5%), nausea (1.25%) and somnolence (1.25%). CONCLUSION In everyday clinical practice in Italy, THC:CBD oromucosal spray provided symptomatic relief of MS spasticity with good tolerability in a relevant number of previously resistant patients.', '2919', NULL);
INSERT INTO public.cannabis_article VALUES (61, 'Pharmacological modulation of neuropathic pain-related depression of behavior: effects of morphine, ketoprofen, bupropion and [INCREMENT]9-tetrahydrocannabinol on formalin-induced depression of intracranial self-stimulation in rats.', 26588213, '2016-01-01', 'Neuropathic pain is often associated with behavioral depression. Intraplantar formalin produces sustained, neuropathy-associated depression of intracranial self-stimulation (ICSS) in rats. This study evaluated pharmacological modulation of formalin-induced ICSS depression. Rats with intracranial electrodes targeting the medial forebrain bundle responded for electrical brain stimulation in an ICSS procedure. Bilateral intraplantar formalin administration depressed ICSS for 14 days. Morphine (0.32-3.2 mg/kg), ketoprofen (0.1-10 mg/kg), bupropion (3.2-32 mg/kg), and [INCREMENT]9-tetrahydrocannabinol (THC; 0.32-3.2 mg/kg) were evaluated for their effectiveness to reverse formalin-induced depression of ICSS. Drug effects on formalin-induced mechanical allodynia were evaluated for comparison. Morphine and bupropion reversed both formalin-induced ICSS depression and mechanical allodynia, and effects on ICSS were sustained during repeated treatment. Ketoprofen failed to reverse either formalin effect. THC blocked mechanical allodynia, but decreased ICSS in control rats and exacerbated formalin-induced depression of ICSS. The failure of ketoprofen to alter formalin effects suggests that formalin effects result from neuropathy rather than inflammation. The effectiveness of morphine and bupropion to reverse formalin effects agrees with other evidence that these drugs block pain-depressed behavior in rats and relieve neuropathic pain in humans. The effects of THC suggest general behavioral suppression and do not support the use of THC to treat neuropathic pain.', '2741', NULL);
INSERT INTO public.cannabis_article VALUES (62, 'The disease-modifying effects of a Sativex-like combination of phytocannabinoids in mice with experimental autoimmune encephalomyelitis are preferentially due to 9-tetrahydrocannabinol acting through CB1 receptors.', 26590655, '2015-01-01', 'Sativex(), an equimolecular combination of (9)-tetrahydrocannabinol-botanical drug substance ((9)-THC-BDS) and cannabidiol-botanical drug substance (CBD-BDS), is a licensed medicine that may be prescribed for alleviating specific symptoms of multiple sclerosis (MS) such as spasticity and pain. However, further evidence suggest that it could be also active as disease-modifying therapy given the immunomodulatory, anti-inflammatory and cytoprotective properties of their two major components. In this study, we investigated this potential in the experimental autoimmune encephalitis (EAE) model of MS in mice. We compared the effect of a Sativex-like combination of (9)-THC-BDS (10 mg/kg) and CBD-BDS (10 mg/kg) with (9)-THC-BDS (20 mg/kg) or CBD-BDS (20 mg/kg) administered separately by intraperitoneal administration to EAE mice. Treatments were initiated at the time that symptoms appear and continued up to the first relapse of the disease. The results show that the treatment with a Sativex-like combination significantly improved the neurological deficits typical of EAE mice, in parallel with a reduction in the number and extent of cell aggregates present in the spinal cord which derived from cell infiltration to the CNS. These effects were completely reproduced by the treatment with (9)-THC-BDS alone, but not by CBD-BDS alone which only delayed the onset of the disease without improving disease progression and reducing the cell infiltrates in the spinal cord. Next, we investigated the potential targets involved in the effects of (9)-THC-BDS by selectively blocking CB(1) or PPAR- receptors, and we found a complete reversion of neurological benefits and the reduction in cell aggregates only with rimonabant, a selective CB(1) receptor antagonist. Collectively, our data support the therapeutic potential of Sativex as a phytocannabinoid formulation capable of attenuating EAE progression, and that the active compound was (9)-THC-BDS acting through CB(1) receptors.', 'CB(1) receptors; EAE mice; Multiple sclerosis; Phytocannabinoid-based medicines; Sativex; Therapeutic effects', 3162);
INSERT INTO public.cannabis_article VALUES (64, 'Cannabidiol exerts anti-convulsant effects in animal models of temporal lobe and partial seizures.', 22520455, '2012-01-01', 'Cannabis sativa has been associated with contradictory effects upon seizure states despite its medicinal use by numerous people with epilepsy. We have recently shown that the phytocannabinoid cannabidiol (CBD) reduces seizure severity and lethality in the well-established in vivo model of pentylenetetrazole-induced generalised seizures, suggesting that earlier, small-scale clinical trials examining CBD effects in people with epilepsy warrant renewed attention. Here, we report the effects of pure CBD (1, 10 and 100mg/kg) in two other established rodent seizure models, the acute pilocarpine model of temporal lobe seizure and the penicillin model of partial seizure. Seizure activity was video recorded and scored offline using model-specific seizure severity scales. In the pilocarpine model CBD (all doses) significantly reduced the percentage of animals experiencing the most severe seizures. In the penicillin model, CBD ( 10 mg/kg) significantly decreased the percentage mortality as a result of seizures; CBD (all doses) also decreased the percentage of animals experiencing the most severe tonic-clonic seizures. These results extend the anti-convulsant profile of CBD; when combined with a reported absence of psychoactive effects, this evidence strongly supports CBD as a therapeutic candidate for a diverse range of human epilepsies.', '3169', NULL);
INSERT INTO public.cannabis_article VALUES (65, 'Cannabidiol reduces lipopolysaccharide-induced vascular changes and inflammation in the mouse brain: an intravital microscopy study.', 21244691, '2011-01-01', 'BACKGROUND The phytocannabinoid cannabidiol (CBD) exhibits antioxidant and antiinflammatory properties. The present study was designed to explore its effects in a mouse model of sepsis-related encephalitis by intravenous administration of lipopolysaccharide (LPS). METHODS Vascular responses of pial vessels were analyzed by intravital microscopy and inflammatory parameters measured by qRT-PCR. RESULTS CBD prevented LPS-induced arteriolar and venular vasodilation as well as leukocyte margination. In addition, CBD abolished LPS-induced increases in tumor necrosis factor-alpha and cyclooxygenase-2 expression as measured by quantitative real time PCR. The expression of the inducible-nitric oxide synthase was also reduced by CBD. Finally, preservation of Blood Brain Barrier integrity was also associated to the treatment with CBD. CONCLUSIONS These data highlight the antiinflammatory and vascular-stabilizing effects of CBD in endotoxic shock and suggest a possible beneficial effect of this natural cannabinoid.', '2789', NULL);
INSERT INTO public.cannabis_article VALUES (66, 'Poly--caprolactone microspheres as a drug delivery system for cannabinoid administration: development, characterization and in vitro evaluation of their antitumoral efficacy.', 22580111, '2012-01-01', 'Cannabinoids show promise for the treatment of various medical conditions such as emesis, anorexia, pain, cancer, multiple sclerosis, Parkinson''s disease and glaucoma. However, their high lipohilicity and instability complicate their handling and dosing, and restrict their use as pharmaceuticals. The objective of the present work was to assess the feasibility of developing cannabinoid loaded poly--caprolactone (PCL) microparticles prepared by the oil-in-water emulsion-solvent evaporation technique as a suitable dosage form for their administration. Spherical microparticles with a size range of 20-50 m, and high entrapment efficiency (around 100%) were obtained. Cannabidiol (CBD) dissolved in the polymeric matrix of the microspheres was slowly released in vitro within 10 days. In vitro cell viability studies demonstrated the antitumoral activity of CBD released from microparticles. After 4 and 7 days of incubation, CBD in microspheres significantly inhibited the growth of MDA-MB-231 cells by 60% as compared to the 50% attained with free drug. The results suggest that PCL microparticles could be an alternative delivery system for long-term cannabinoid administration, showing potential therapeutic advantages over free drug.', '2977', NULL);
INSERT INTO public.cannabis_article VALUES (67, 'Single-dose pharmacokinetics and tolerability of oral delta-9- tetrahydrocannabinol in patients with amyotrophic lateral sclerosis.', 22594565, '2012-01-01', 'BACKGROUND Cannabinoids exert neuroprotective and symptomatic effects in amyotrophic lateral sclerosis (ALS). We assessed the pharmacokinetics (PK) and tolerability of delta-9-tetrahydrocannabinol (THC) in ALS patients. METHODS Nine patients received THC single oral doses of 5mg and 10mg, separated by a wash-out period of two weeks. Blood samples for the determination of THC, 11-nor-9-carboxy-THC (THC-COOH) and hydroxy-THC (THC-OH) were taken up to 8 hours after intake. Adverse events were assessed by visual analogue scales (VAS). Plasma concentrations of the active metabolite THC-OH were submitted to sequential pharmacokinetic-pharmacodynamic population modeling on individual heart rate as a proxy for THC''s cardiovasculatory effects. RESULTS Drowsiness, euphoria, orthostasis, sleepiness, vertigo and weakness were significantly more frequent in patients receiving 10mg compared to 5 mg THC. A marked interindividual variability was found for the absorption of oral THC (84%) and elimination of THC-COOH (45%). PK data did not support any clinically relevant deviation from linear PK in the investigated range of concentrations. Plasma concentrations of THC-OH were positively correlated with the individual heart rate. An E(max-model) was successfully fitted to individual heart rate, with a THC-OH plasma concentration of 3.2 x 10(-4) mol/L for EC(50) and an E(max) of 93 bpm for heart rate. CONCLUSIONS The higher 10mg dose of THC was dose-limiting in patients with ALS. High interindividual PK variability requires individuell titration of THC for potential therapeutic use in patients with ALS.', '3188', NULL);
INSERT INTO public.cannabis_article VALUES (68, 'The safety of studies with intravenous -tetrahydrocannabinol in humans, with case histories.', 21845389, '2012-01-01', 'RATIONALE Delta-9-tetrahydrocannabinol (THC) is one of the few cannabinoid receptor ligands that can be used to probe the cannabinoid system in humans. Despite increasing interest in the cannabinoid receptor system, use of intravenous THC as a research tool has been limited by concerns about its abuse liability and psychoactive effects. OBJECTIVES This study aims to evaluate the safety of all intravenous THC studies conducted at this center for the past 13 years. METHODS Included were 11 studies with 266 subjects (14 schizophrenia patients and 252 healthy subjects, of whom 76 were frequent cannabis users), 351 active THC infusions, and 226 placebo infusions. Subjects were monitored for subjective and physical adverse events and followed up to 12 months beyond study participation. RESULTS There was one serious and 70 minor adverse events in 9.7% of subjects and 7.4% of infusions, with 8.5% occurring after the end of the test day. Nausea and dizziness were the most frequent side effects. Adverse events were more likely to be associated with faster infusion rates (2-5 min) and higher doses (>2.1 mg/70 kg). Of 149 subjects on whom long-term follow-up data were gathered, 94% reported either no change or a reduction in their desire to use cannabis in the post-study period, 18% stated that their cannabis use decreased, and 3% stated that it increased in the post-study period. CONCLUSIONS With careful subject selection and screening, risk to subjects is relatively low. Safeguards are generally sufficient and effective, reducing both the duration and severity of adverse events.', '4476', NULL);
INSERT INTO public.cannabis_article VALUES (69, 'Cannabidiol and palmitoylethanolamide are anti-inflammatory in the acutely inflamed human colon.', 28954820, '2017-01-01', 'OBJECTIVE We sought to quantify the anti-inflammatory effects of two cannabinoid drugs, cannabidiol (CBD) and palmitoylethanolamide (PEA), in cultured cell lines and compared this effect with experimentally inflamed explant human colonic tissue. These effects were explored in acutely and chronically inflamed colon, using inflammatory bowel disease and appendicitis explants. DESIGN Caco-2 cells and human colonic explants collected from elective bowel cancer, inflammatory bowel disease (IBD) or acute appendicitis resections, and were treated with the following drug treatments: vehicle, an inflammatory protocol of interferon  (IFN) and tumour necrosis factor  (TNF; 10 ng/ml), inflammation and PEA (10 M), inflammation and CBD (10 M), and PEA or CBD alone, CBD or vehicle were added simultaneously with IFN. Nine intracellular signalling phosphoproteins were determined by multiplex. Inflammatory cytokine secretion was determined using ELISA. Receptor mechanisms were investigated using antagonists for CB1, CB2, PPAR, PPAR, TRPV1 and GPR55. RESULTS IFN and TNF treatment increased phosphoprotein and cytokine levels in Caco-2 cultures and colonic explants. Phosphoprotein levels were significantly reduced by PEA or CBD in Caco-2 cultures and colonic explants. CBD and PEA prevented increases in cytokine production in explant colon, but not in Caco-2 cells. CBD effects were blocked by the CB2 antagonist AM630 and TRPV1 antagonist SB366791. PEA effects were blocked by the PPAR antagonist GW6471. PEA and CBD were anti-inflammatory in IBD and appendicitis explants. CONCLUSION PEA and CBD are anti-inflammatory in the human colon. This effect is not seen in cultured epithelial cells. Appropriately sized clinical trials should assess their efficacy.', 'Bowel; Cannbinoids; Gut; Intestine; colon; inflammation', 2909);
INSERT INTO public.cannabis_article VALUES (70, 'Inhibition of colon carcinogenesis by a standardized Cannabis sativa extract with high content of cannabidiol.', 24373545, '2014-01-01', 'PURPOSE Colon cancer is a major public health problem. Cannabis-based medicines are useful adjunctive treatments in cancer patients. Here, we have investigated the effect of a standardized Cannabis sativa extract with high content of cannabidiol (CBD), here named CBD BDS, i.e. CBD botanical drug substance, on colorectal cancer cell proliferation and in experimental models of colon cancer in vivo. METHODS Proliferation was evaluated in colorectal carcinoma (DLD-1 and HCT116) as well as in healthy colonic cells using the MTT assay. CBD BDS binding was evaluated by its ability to displace [(3)H]CP55940 from human cannabinoid CB1 and CB2 receptors. In vivo, the effect of CBD BDS was examined on the preneoplastic lesions (aberrant crypt foci), polyps and tumours induced by the carcinogenic agent azoxymethane (AOM) as well as in a xenograft model of colon cancer in mice. RESULTS CBD BDS and CBD reduced cell proliferation in tumoral, but not in healthy, cells. The effect of CBD BDS was counteracted by selective CB1 and CB2 receptor antagonists. Pure CBD reduced cell proliferation in a CB1-sensitive antagonist manner only. In binding assays, CBD BDS showed greater affinity than pure CBD for both CB1 and CB2 receptors, with pure CBD having very little affinity. In vivo, CBD BDS reduced AOM-induced preneoplastic lesions and polyps as well as tumour growth in the xenograft model of colon cancer. CONCLUSIONS CBD BDS attenuates colon carcinogenesis and inhibits colorectal cancer cell proliferation via CB1 and CB2 receptor activation. The results may have some clinical relevance for the use of Cannabis-based medicines in cancer patients.', '?(9)-Tetrahydrocannabinol; Cancer cell growth; Cannabidiol; Cannabinoid receptors; Chemoprevention; Colorectal cancer', 3094);
INSERT INTO public.cannabis_article VALUES (71, 'Mediation of cannabidiol anti-inflammation in the retina by equilibrative nucleoside transporter and A2A adenosine receptor.', 18641283, '2008-01-01', 'PURPOSE Cannabidiol (CBD), a nonpsychotropic, nontoxic compound has been shown to block diabetes- and endotoxin-induced retinal damage. However, the protective mechanism of this anti-inflammatory cannabinoid is not completely understood. The goal of this study is to determine the role of adenosine signaling in retinal inflammation and its potential modulation by CBD. METHODS The adenosine receptor (AR) subtypes expressed in rat retinal microglial cells were assessed by quantitative real-time RT-PCR. AR function was determined via in vitro and in vivo inflammatory models. Microglial cells or rats were treated with or without lipopolysaccharide (LPS) in the presence or absence of adenosine, adenosine receptor agonists/antagonists, or CBD. Adenosine uptake and tumor necrosis factor (TNF)-alpha release in cells or in retinas were determined. RESULTS The results showed that A(2A)ARs are abundantly expressed in rat retinal microglial cells. When the cells or rats were treated with LPS, activation of the A(2A)AR was the most efficient in mediating AR agonist- or CBD-induced TNF-alpha inhibition. CBD inhibited adenosine uptake via equilibrative nucleoside transporter 1 and synergistically enhanced adenosine''s TNF-alpha suppression after treatment with LPS. CONCLUSIONS These results suggest that the activated A(2A)AR in the retinal microglial cells plays a major anti-inflammatory role in the retina and that CBD''s anti-inflammatory effects are linked to the inhibition of adenosine uptake.', '4387', NULL);
INSERT INTO public.cannabis_article VALUES (72, 'Cannabidiol promotes browning in 3T3-L1 adipocytes.', 27067870, '2016-01-01', 'Recruitment of the brown-like phenotype in white adipocytes (browning) and activation of existing brown adipocytes are currently being investigated as a means to combat obesity. Thus, a wide variety of dietary agents that contribute to browning of white adipocytes have been identified. The present study was designed to investigate the effects of cannabidiol (CBD), a major nonpsychotropic phytocannabinoid of Cannabis sativa, on induction of browning in 3T3-L1 adipocytes. CBD enhanced expression of a core set of brown fat-specific marker genes (Ucp1, Cited1, Tmem26, Prdm16, Cidea, Tbx1, Fgf21, and Pgc-1) and proteins (UCP1, PRDM16, and PGC-1). Increased expression of UCP1 and other brown fat-specific markers contributed to the browning of 3T3-L1 adipocytes possibly via activation of PPAR and PI3K. In addition, CBD increased protein expression levels of CPT1, ACSL, SIRT1, and PLIN while down-regulating JNK2, SREBP1, and LPL. These data suggest possible roles for CBD in browning of white adipocytes, augmentation of lipolysis, thermogenesis, and reduction of lipogenesis. In conclusion, the current data suggest that CBD plays dual modulatory roles in the form of inducing the brown-like phenotype as well as promoting lipid metabolism. Thus, CBD may be explored as a potentially promising therapeutic agent for the prevention of obesity.', 'Browning; Cannabidiol; Lipogenesis; Thermogenesis', 2592);
INSERT INTO public.cannabis_article VALUES (73, 'Effects of a Sativex-Like Combination of Phytocannabinoids on Disease Progression in R6/2 Mice, an Experimental Model of Huntington''s Disease.', 28333097, '2017-01-01', 'Several cannabinoids afforded neuroprotection in experimental models of Huntington''s disease (HD). We investigated whether a 1:1 combination of botanical extracts enriched in either -tetrahydrocannabinol (-THC) or cannabidiol (CBD), which are the main constituents of the cannabis-based medicine Sativex, is beneficial in R6/2 mice (a transgenic model of HD), as it was previously shown to have positive effects in neurotoxin-based models of HD. We recorded the progression of neurological deficits and the extent of striatal deterioration, using behavioral, in vivo imaging, and biochemical methods in R6/2 mice and their corresponding wild-type mice. The mice were daily treated, starting at 4 weeks after birth, with a Sativex-like combination of phytocannabinoids (equivalent to 3 mg/kg weight of pure CBD + -THC) or vehicle. R6/2 mice exhibited the characteristic deterioration in rotarod performance that initiated at 6 weeks and progressed up to 10 weeks, and elevated clasping behavior reflecting dystonia. Treatment with the Sativex-like combination of phytocannabinoids did not recover rotarod performance, but markedly attenuated clasping behavior. The in vivo positron emission tomography (PET) analysis of R6/2 animals at 10 weeks revealed a reduced metabolic activity in the basal ganglia, which was partially attenuated by treatment with the Sativex-like combination of phytocannabinoids. Proton nuclear magnetic resonance spectroscopy (H-MRS) analysis of the ex vivo striatum of R6/2 mice at 12 weeks revealed changes in various prognostic markers reflecting events typically found in HD patients and animal models, such as energy failure, mitochondrial dysfunction, and excitotoxicity. Some of these changes (taurine/creatine, taurine/N-acetylaspartate, and N-acetylaspartate/choline ratios) were completely reversed by treatment with the Sativex-like combination of phytocannabinoids. A Sativex-like combination of phytocannabinoids administered to R6/2 mice at the onset of motor symptoms produced certain benefits on the progression of striatal deterioration in these mice, which supports the interest of this cannabinoid-based medicine for the treatment of disease progression in HD patients.', 'Huntingtons disease; R6/2 mice; basal ganglia; cannabidiol; neuroprotection; phytocannabinoids; 9-tetrahydrocannabinol', 2692);
INSERT INTO public.cannabis_article VALUES (74, 'Selective post-training time window for memory consolidation interference of cannabidiol into the prefrontal cortex: Reduced dopaminergic modulation and immediate gene expression in limbic circuits.', 28344069, '2017-01-01', 'The prefrontal cortex (PFC), amygdala and hippocampus display a coordinated activity during acquisition of associative fear memories. Evidence indicates that PFC engagement in aversive memory formation does not progress linearly as previously thought. Instead, it seems to be recruited at specific time windows after memory acquisition, which has implications for the treatment of post-traumatic stress disorders. Cannabidiol (CBD), the major non-psychotomimetic phytocannabinoid of the Cannabis sativa plant, is known to modulate contextual fear memory acquisition in rodents. However, it is still not clear how CBD interferes with PFC-dependent processes during post-training memory consolidation. Here, we tested whether intra-PFC infusions of CBD immediately after or 5h following contextual fear conditioning was able to interfere with memory consolidation. Neurochemical and cellular correlates of the CBD treatment were evaluated by the quantification of extracellular levels of dopamine (DA), serotonin, and their metabolites in the PFC and by measuring the cellular expression of activity-dependent transcription factors in cortical and limbic regions. Our results indicate that bilateral intra-PFC CBD infusion impaired contextual fear memory consolidation when applied 5h after conditioning, but had no effect when applied immediately after it. This effect was associated with a reduction in DA turnover in the PFC following retrieval 5days after training. We also observed that post-conditioning infusion of CBD reduced c-fos and zif-268 protein expression in the hippocampus, PFC, and thalamus. Our findings support that CBD interferes with contextual fear memory consolidation by reducing PFC influence on cortico-limbic circuits.', 'C-fos; cannabidiol; contextual fear memory; dopamine; medial prefrontal cortex', 2540);
INSERT INTO public.cannabis_article VALUES (75, 'Low-Dose Cannabidiol Is Safe but Not Effective in the Treatment for Crohn''s Disease, a Randomized Controlled Trial.', 28349233, '2017-01-01', 'BACKGROUND Cannabidiol (CBD) is an anti-inflammatory cannabinoid shown to be beneficial in a mouse model of IBD. Lacking any central effect, cannabidiol is an attractive option for treating inflammatory diseases. AIM To assess the effects of cannabidiol on Crohn''s disease in a randomized placebo-controlled trial. PATIENTS AND METHODS Twenty patients aged 18-75 years with a Crohn''s disease activity index (CDAI) >200 were randomized to receive oral (10 mg) CBD or placebo twice daily. Patients did not respond to standard treatment with steroids (11 patients), thiopurines (14), or TNF antagonists (11). Disease activity and laboratory parameters were assessed during 8 weeks of treatment and 2 weeks thereafter. Other medical treatment remained unchanged. RESULTS Of 20 patients recruited 19 completed the study. Their mean age was 39  15, and 11 were males. The average CDAI before cannabidiol consumption was 337  108 and 308  96 (p = NS) in the CBD and placebo groups, respectively. After 8 weeks of treatment, the index was 220  122 and 216  121 in the CBD and placebo groups, respectively (p = NS). Hemoglobin, albumin, and kidney and liver function tests remained unchanged. No side effects were observed. CONCLUSION In this study of moderately active Crohn''s disease, CBD was safe but had no beneficial effects. This could be due to lack of effect of CBD on Crohn''s disease, but could also be due to the small dose of CBD, the small number of patients in the study, or the lack of the necessary synergism with other cannabinoids. Further investigation is warranted. CLINICALTRIALS.GOV: NCT01037322.', 'Cannabidiol; Cannabis; Crohns disease; Inflammatory bowel disease', 4331);
INSERT INTO public.cannabis_article VALUES (76, 'Efficacy of two cannabis based medicinal extracts for relief of central neuropathic pain from brachial plexus avulsion: results of a randomised controlled trial.', 15561385, '2004-01-01', 'The objective was to investigate the effectiveness of cannabis-based medicines for treatment of chronic pain associated with brachial plexus root avulsion. This condition is an excellent human model of central neuropathic pain as it represents an unusually homogenous group in terms of anatomical location of injury, pain descriptions and patient demographics. Forty-eight patients with at least one avulsed root and baseline pain score of four or more on an 11-point ordinate scale participated in a randomised, double-blind, placebo-controlled, three period crossover study. All patients had intractable symptoms regardless of current analgesic therapy. Patients entered a baseline period of 2 weeks, followed by three, 2-week treatment periods during each of which they received one of three oromucosal spray preparations. These were placebo and two whole plant extracts of Cannabis sativa L.: GW-1000-02 (Sativex), containing Delta(9)tetrahydrocannabinol (THC):cannabidiol (CBD) in an approximate 1:1 ratio and GW-2000-02, containing primarily THC. The primary outcome measure was the mean pain severity score during the last 7 days of treatment. Secondary outcome measures included pain related quality of life assessments. The primary outcome measure failed to fall by the two points defined in our hypothesis. However, both this measure and measures of sleep showed statistically significant improvements. The study medications were generally well tolerated with the majority of adverse events, including intoxication type reactions, being mild to moderate in severity and resolving spontaneously. Studies of longer duration in neuropathic pain are required to confirm a clinically relevant, improvement in the treatment of this condition.', '2486', NULL);
INSERT INTO public.cannabis_article VALUES (19, 'Differential effectiveness of selected non-psychotropic phytocannabinoids on human sebocyte functions implicates their introduction in dry/seborrhoeic skin and acne treatment.', 27094344, '2016-01-01', 'Acne is a common skin disease characterized by elevated sebum production and inflammation of the sebaceous glands. We have previously shown that a non-psychotropic phytocannabinoid ((-)-cannabidiol [CBD]) exerted complex anti-acne effects by normalizing ''pro-acne agents''-induced excessive sebaceous lipid production, reducing proliferation and alleviating inflammation in human SZ95 sebocytes. Therefore, in this study we aimed to explore the putative anti-acne effects of further non-psychotropic phytocannabinoids ((-)-cannabichromene [CBC], (-)-cannabidivarin [CBDV], (-)-cannabigerol [CBG], (-)-cannabigerovarin [CBGV] and (-)-(9) -tetrahydrocannabivarin [THCV]). Viability and proliferation of human SZ95 sebocytes were investigated by MTT and CyQUANT assays; cell death and lipid synthesis were monitored by DilC1 (5)-SYTOX Green labelling and Nile Red staining, respectively. Inflammatory responses were investigated by monitoring expressions of selected cytokines upon lipopolysaccharide treatment (RT-qPCR, ELISA). Up to 10 m, the phytocannabinoids only negligibly altered the viability of the sebocytes, whereas high doses (50 m) induced apoptosis. Interestingly, basal sebaceous lipid synthesis was differentially modulated by the substances: CBC and THCV suppressed it, and CBDV had only minor effects, whereas CBG and CBGV increased it. Importantly, CBC, CBDV and THCV significantly reduced arachidonic acid (AA)-induced ''acne-like'' lipogenesis. Moreover, THCV suppressed proliferation, and all phytocannabinoids exerted remarkable anti-inflammatory actions. Our data suggest that CBG and CBGV may have potential in the treatment of dry-skin syndrome, whereas CBC, CBDV and especially THCV show promise to become highly efficient, novel anti-acne agents. Moreover, based on their remarkable anti-inflammatory actions, phytocannabinoids could be efficient, yet safe novel tools in the management of cutaneous inflammations.', 'acne vulgaris; cutaneous inflammation; dry skin; phytocannabinoid', 2683);
